em\";a:10:{i:0;a:6:{s:4:\"data\";s:33:\"\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:20:\"WordPress 4.7 Beta 1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://wordpress.org/news/2016/10/wordpress-4-7-beta-1/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 28 Oct 2016 04:30:27 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=4535\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:329:\"WordPress 4.7 Beta 1 is now available! This software is still in development, so we don’t recommend you run it on a production site. Consider setting up a test site just to play with the new version. To test WordPress 4.7, try the WordPress Beta Tester plugin (you’ll want “bleeding edge nightlies”). Or you can [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Helen Hou-Sandi\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:6895:\"<p>WordPress 4.7 Beta 1 is now available!</p>\n<p><strong>This software is still in development,</strong> so we don’t recommend you run it on a production site. Consider setting up a test site just to play with the new version. To test WordPress 4.7, try the <a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a> plugin (you’ll want “bleeding edge nightlies”). Or you can <a href=\"https://wordpress.org/wordpress-4.7-beta1.zip\">download the beta here</a> (zip).</p>\n<p>WordPress 4.7 is slated for release on <a href=\"https://make.wordpress.org/core/4-7/\">December 6</a>, but we need your help to get there. We&#8217;ve been working on a lot of things, many of them to make getting your site set up the way you want it much easier. Here are some of the bigger items to test and help us find as many bugs as possible in the coming weeks:</p>\n<ul>\n<li><a href=\"http://2017.wordpress.net/\"><strong>Twenty Seventeen</strong></a> &#8211; A brand new default theme brings your site to life with immersive featured images, video headers, and subtle animations. With a focus on business sites, it features multiple sections on the front page as well as widgets, navigation and social menus, a logo, and more. Personalize its asymmetrical grid with a custom color scheme and showcase your multimedia content with post formats. Our default theme for 2017 works great in many languages, for any abilities, and on any device.</li>\n<li><strong>Video Headers</strong> &#8211; Sometimes a big atmospheric video as a moving header image is just what you need to showcase your wares; go ahead and try it out with Twenty Seventeen. Need some video inspiration? Try searching for sites with video headers available for download and use.</li>\n<li><strong>Set up your site in one flow</strong> &#8211; From finding and installing themes right inside the customizer, to automatically staged theme-specific starter content, to clickable shortcuts that jump directly to editing an item from the preview pane, to adding pages while you&#8217;re building a nav menu or setting a static front page: getting a new site spun up and ready to share with a friend or a coworker is faster and easier than it&#8217;s ever been. Note: starter content appears when live previewing brand new sites and is currently only available in Twenty Seventeen. We&#8217;ll be expanding this to other bundled themes very soon, and perhaps to sites with existing content in future releases of WordPress.</li>\n<li><strong>Custom CSS with live previews</strong> &#8211; Ever needed to hide or tweak the look of something in your theme or from a plugin? Now you can do it with CSS and live preview the results while customizing your site. CSS can be a powerful tool; you may find that you won&#8217;t need the theme editor or child themes anymore.</li>\n<li><strong>User admin languages</strong> &#8211; Just because your site is in one language doesn&#8217;t mean that everybody helping manage it prefers that language for their admin. To try this out, you&#8217;ll need to have more than one language installed, which will make a user language option available in your profile.</li>\n<li><strong>PDF thumbnail previews</strong> &#8211; Uploading PDFs will now generate thumbnail images so you can more easily distinguish between all your documents.</li>\n</ul>\n<p>As always, there have been exciting changes for developers to explore as well, such as:</p>\n<ul>\n<li><strong>REST API content endpoints</strong> &#8211; If you only test one thing as a developer, please test these. This phase is particularly helpful for people building plugins, themes, and in-admin interfaces. Can you build the things you need? Are these ready for release, and is the world ready for them? (<a href=\"https://core.trac.wordpress.org/ticket/38373\">#38373</a>)</li>\n<li><strong><code>WP_Hook</code></strong> &#8211; The code that lies beneath actions and filters has been overhauled. You likely aren&#8217;t affected, but if you&#8217;ve done things to the <code>$wp_filter</code> global or experienced funky recursion bugs in the past, <a href=\"https://make.wordpress.org/core/2016/09/08/wp_hook-next-generation-actions-and-filters/\">please take a moment to read the dev note</a> and test your code.</li>\n<li><a href=\"https://make.wordpress.org/core/2016/10/04/custom-bulk-actions/\"><strong>Custom bulk actions</strong></a> &#8211; List tables, now with more than bulk edit and delete.</li>\n<li>Expanded <a href=\"https://make.wordpress.org/core/2016/10/26/registering-your-settings-in-wordpress-4-7/\"><strong>Settings Registration API</strong></a> via <code>register_setting()</code>.</li>\n<li>For theme developers: <strong>Post type templates</strong> (<a href=\"https://core.trac.wordpress.org/ticket/18375\">#18375</a>)</li>\n<li><strong><a href=\"https://make.wordpress.org/core/2016/09/09/new-functions-hooks-and-behaviour-for-theme-developers-in-wordpress-4-7/\">More goodies for theme developers!</a></strong></li>\n<li><strong>Locale switching</strong> (<a href=\"https://core.trac.wordpress.org/ticket/26511\">#26511</a>)</li>\n<li><a href=\"https://make.wordpress.org/core/2016/10/11/comment-allowed-checks-in-wordpress-4-7/\"><strong>Comment allowed checks</strong></a> have the potential for a back-compat break.</li>\n</ul>\n<p>If you want a more in-depth view of what major changes have made it into 4.7, <a href=\"https://make.wordpress.org/core/tag/4-7/\">check out posts tagged with 4.7 on the main development blog</a>, or look at a <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;resolution=fixed&amp;milestone=4.7&amp;group=component&amp;order=priority\">list of everything</a> that’s changed. There will be more developer notes to come, so keep an eye out for those as well.</p>\n<p><strong>If you think you’ve found a bug</strong>, you can post to the <a href=\"https://wordpress.org/support/forum/alphabeta\">Alpha/Beta area</a> in the support forums. We’d love to hear from you! If you’re comfortable writing a reproducible bug report, <a href=\"https://make.wordpress.org/core/reports/\">file one on WordPress Trac</a>, where you can also find <a href=\"https://core.trac.wordpress.org/tickets/major\">a list of known bugs</a>.</p>\n<p>Happy testing, and please enjoy this extended haiku break, courtesy of <a href=\"https://profiles.wordpress.org/ramiabraham\">Rami Abraham</a><em>.</em></p>\n<p><em>Exquisite endpoints</em><br />\n<em>Extol epic exabytes</em><br />\n<em>Enabling earthlings</em></p>\n<p><em>Careful interfaces</em><br />\n<em>Considerately conjured</em><br />\n<em>Customizer chic</em></p>\n<p><em>Ring in the new year</em><br />\n<em>With elegance and balance</em><br />\n<em>Twenty Seventeen</em></p>\n<p><em>Hooks hook healthily</em><br />\n<em>17817</em><br />\n<em>Sane iterations</em></p>\n<p><em>Admin in your tongue<br />\nOne site, many languages<br />\nWe all speak WordPress</em></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"4535\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:45:\"\n		\n		\n		\n		\n				\n		\n		\n		\n		\n\n		\n		\n				\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"Join Us Again for Global WordPress Translation Day\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"https://wordpress.org/news/2016/10/join-us-again-for-global-wordpress-translation-day/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 14 Oct 2016 13:33:57 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:5:{i:0;a:5:{s:4:\"data\";s:9:\"Community\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:19:\"contributor weekend\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:32:\"global wordpress translation day\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:9:\"polyglots\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:4;a:5:{s:4:\"data\";s:12:\"translations\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=4516\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:373:\"The WordPress Polyglots team is organizing the second Global WordPress Translation Day on November 12th. Everyone is invited to join – from anywhere in the world! Translating is one of the easiest ways to get involved with WordPress and contribute to the project. Global WordPress Translation Day is your chance to learn more about translating WordPress, meet [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Petya Raykovska\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:4273:\"<p>The WordPress Polyglots team is organizing the second <a href=\"https://wptranslationday.org/\">Global WordPress Translation Day</a> on November 12th. Everyone is invited to join – from anywhere in the world!</p>\n<p>Translating is one of the easiest ways to get involved with WordPress and contribute to the project. Global WordPress Translation Day is your chance to learn more about translating WordPress, meet people from all over the world, and <a href=\"https://make.wordpress.org/polyglots/teams\">translate WordPress into one of more than 160 languages</a>.</p>\n<h3>Join us on November 12th from anywhere in the world</h3>\n<p>The translation day starts on Saturday, November 12th, 2016, at 0:00 UTC and ends 24 hours later. <a href=\"http://arewemeetingyet.com/UTC/2016-11-12/00:00/Global%20WordPress%20Translation%20Day%202\">See what time that is for you!</a> You can join right from the start, or any time it&#8217;s convenient for you throughout the day.</p>\n<h3>What are we doing?</h3>\n<p>Local contributor days are happening all over the world, and are a great way to get involved. <a href=\"https://www.google.com/maps/d/viewer?mid=12Gni4JMfShyWHPqGNwh5-PMneMM&amp;usp=sharing\">Check out this map</a> to see if there&#8217;s already a local event happening near you. Can&#8217;t find one? <a href=\"https://make.wordpress.org/polyglots/2016/09/22/global-wordpress-translation-day-2-on-november-12th-2016/\">Organize a local event!</a></p>\n<p>At the same time, <a href=\"https://www.crowdcast.io/e/gwtd2/register\">join the community for 24 hours of live-streamed, remote sessions</a> in numerous languages. Sessions will cover localization, internationalization, and contributing in your language.</p>\n<h3>Who&#8217;s it for?</h3>\n<p>Whether you&#8217;re new to translating and want to learn how to translate, or an experienced translation editor building a strong team, the translation day is for <i>you</i>. Developers will also enjoy topics from experienced contributors, whether you&#8217;re learning about internationalization and or want to find more translators for your themes and plugins. There&#8217;s a session for everyone!</p>\n<h3>Get Involved</h3>\n<p>Joining is easy! On November 12th, in your own timezone, <a href=\"https://translate.wordpress.org\">translate WordPress</a> or your favorite plugins and themes into your language, while watching live sessions over the course of the day.</p>\n<p>Want to get more involved? <a href=\"https://make.wordpress.org/polyglots/2016/09/22/global-wordpress-translation-day-2-on-november-12th-2016/\">Sign up to organize a local event</a> and invite your local community to translate together on November 12th. Events can be formal or completely informal – grab your laptop and a couple of friends, and head to a local coffee shop to translate for an hour or two.</p>\n<h3>Can you get involved if you only speak English?</h3>\n<p>Absolutely! Even if you only speak English, there are great sessions about internationalization that can benefit every developer. There&#8217;s also lots of English variants that need your help! For example, English is spoken and written differently in Australia, Canada, New Zealand, South Africa, and the United Kingdom. You can learn about these differences and why these variants are important during the sessions.</p>\n<p>And if you’re feeling fun, try translating WordPress into emoji! Yep, we have a translation of WordPress in emoji! <img src=\"https://s.w.org/images/core/emoji/2.2.1/72x72/1f30e.png\" alt=\"','no'),(469,'_transient_timeout_feed_mod_ac0b00fe65abe10e0c5b588f3ed8c7ca','1478013007','no'),(470,'_transient_feed_mod_ac0b00fe65abe10e0c5b588f3ed8c7ca','1477969807','no'),(471,'_transient_timeout_feed_d117b5738fbd35bd8c0391cda1f2b5d9','1478013007','no'),(472,'_transient_feed_d117b5738fbd35bd8c0391cda1f2b5d9','a:4:{s:5:\"child\";a:1:{s:0:\"\";a:1:{s:3:\"rss\";a:1:{i:0;a:6:{s:4:\"data\";s:3:\"\n\n\n\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:7:\"version\";s:3:\"2.0\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:0:\"\";a:1:{s:7:\"channel\";a:1:{i:0;a:6:{s:4:\"data\";s:61:\"\n	\n	\n	\n	\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:16:\"WordPress Planet\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://planet.wordpress.org/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"language\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"en\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"WordPress Planet - http://planet.wordpress.org/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"item\";a:50:{i:0;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:99:\"WPTavern: Mullenweg Takes Aim at Wix over GPL Abuses, Wix Response Fails to Address Licensing Issue\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=63325\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:109:\"https://wptavern.com/mullenweg-takes-aim-at-wix-over-gpl-abuses-wix-response-fails-to-address-licensing-issue\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:12007:\"<p>Over the weekend WordPress co-creator and Automattic CEO Matt Mullenweg <a href=\"https://ma.tt/2016/10/wix-and-the-gpl/\" target=\"_blank\">called out Wix for copying GPL code</a> from the WordPress mobile app and distributing it in its <a href=\"http://www.prnewswire.com/news-releases/wixcom-launches-wix-app-providing-a-powerful-mobile-operating-system-for-small-business-owners-store-owners-hoteliers-and-bloggers-around-the-world-300339448.html\" target=\"_blank\">proprietary app</a>. He identified <a href=\"https://github.com/wix/WordPress-Editor-Android\" target=\"_blank\">two</a> <a href=\"https://github.com/wix/react-native-wordpress-editor\" target=\"_blank\">repositories</a> that Wix forked in order to bring the GPL-licensed WordPress Rich Text Editor into its app.</p>\n<p>&#8220;If I were being charitable, I’d say, &#8216;The app’s editor is based on the WordPress mobile app’s editor.&#8217; Mullenweg said. &#8220;If I were being honest, I’d say that Wix copied WordPress without attribution, credit, or following the license.&#8221;</p>\n<p>Even though the Wix app is made up of different modules and libraries, the GPL requires that the entire application be GPL-licensed since Wix is distributing the app with GPL code in it. Open sourcing the entire app&#8217;s code under the GPL is the only way to resolve the license violation, according to Mullenweg.</p>\n<p>&#8220;Your app’s editor is built with stolen code, so your whole app is now in violation of the license,&#8221; Mullenwg said. Some took issue with use of the term &#8220;stolen code&#8221; in connection with public, open source repositories, but the effect is the same regardless of Wix&#8217;s intention. Wix distributed GPL code without respecting its license, putting new limitations on it instead of preserving its freedoms. That code was not legally available to be repurposed without following its license.</p>\n<p>&#8220;You’d probably be in the clear if you had used just the original editor we started with (ZSSRichTextEditor, MIT licensed),&#8221; Automattic&#8217;s General Counsel Paul Sieminski commented on the issue. &#8220;Instead, Wix took our version of the editor which has 1000+ original commits on top of the original MIT editor, that took more than a year to write. We improved it. A lot. And Wix took those improvements, used them in their app but then stripped out all of the important rights that they’re not legally allowed to take away.&#8221;</p>\n<p>Mullenweg called for Wix to release its entire mobile app under the GPL, as required by the license, and make the source code available so that others can build on it and learn from it.</p>\n<p>&#8220;If you want to close the door on innovation, Wix, that’s your decision to make — just write your own code,&#8221; Mullenweg said. &#8220;If you’re going to join the open source community, play by the open source rules.&#8221;</p>\n<h3>Wix CEO Responds, Neglects to Address GPL Licensing Issues</h3>\n<p>Mullenweg&#8217;s open letter to Wix took the company by surprise. Wix CEO Avishai Abrahami <a href=\"http://www.wix.com/blog/2016/10/dear-matt-mullenweg-an-open-letter-from-wix-coms-ceo-avishai-abrahami/\" target=\"_blank\">responded</a> the next day on the company&#8217;s blog with a tone that imposed an artificial sense of fraternity in order to make the original allegation appear to be an over reaction. &#8220;Wow, dude I did not even know we were fighting,&#8221; Abrahami said. He cited Wix&#8217;s manifold contributions to open source software on the company&#8217;s GitHub account and their admiration of WordPress&#8217; commitment to giving back.</p>\n<p>His artful deflection avoids the licensing issue completely and demonstrates a lack of understanding of the GPL:</p>\n<blockquote><p>Yes, we did use the WordPress open source library for a minor part of the application (that is the concept of open source right?), and everything we improved there or modified, we submitted back as open source, see here in this <a href=\"https://github.com/wix/react-native-wordpress-editor\" target=\"_blank\">link</a> – you should check it out, pretty cool way of using it on mobile native. I really think you guys can use it with your app (and it is open source, so you are welcome to use it for free). And, by the way, the part that we used was in fact developed by another and modified by you.</p></blockquote>\n<p>GPL compliance, however, requires more than a show of open source spirit. Abrahami did not address the requirement that the entire mobile app be released as GPL but offered a vague statement about sharing code.</p>\n<p>&#8220;If you need source code that we have, and we have not yet released, then, most likely we will be happy to share, you only need to ask,&#8221; Abrahami said. It is still unclear as to whether his statement means the company will release the entire mobile app under the GPL or not. However, the company indicated on Twitter that they will release the app on GitHub.</p>\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\"><a href=\"https://twitter.com/yairwein\">@yairwein</a> We\'ll release the code on Github, where we also shared our previous projects: <a href=\"https://t.co/FBhp2Kd5wn\">https://t.co/FBhp2Kd5wn</a></p>\n<p>&mdash; Wix.com (@Wix) <a href=\"https://twitter.com/Wix/status/792656290854174721\">October 30, 2016</a></p></blockquote>\n<p></p>\n<p>The other option would be for the company to completely remove any GPL code from its app and use the original MIT-licensed library for the editor.</p>\n<p>&#8220;The WordPress GPL Rich Text component in question, is actually a wrapper around another Rich Text component named ZSSRichTextEditor which is licensed MIT,&#8221; Wix lead engineer Tal Kol said in the article he <a href=\"https://medium.com/@talkol/how-i-found-myself-accused-of-stealing-code-from-wordpress-a7350da9f9f2#.h5zgf9lnc\" target=\"_blank\">published</a> over the weekend. &#8220;In retrospect it would have been easier to use it directly.&#8221;</p>\n<p>Using the original library would stop the current GPL infringement but does not erase the fact that the company has already violated the license by distributing the code.</p>\n<p>Wix has not yet officially announced what it plans to do, but at the time of publishing the company continues to distribute GPL code inside its proprietary app.</p>\n<h3>Mullenweg Is Willing to Go to Court to Protect the GPL</h3>\n<p>According to the GNU.org GPL FAQ, the <a href=\"https://www.gnu.org/licenses/gpl-faq.en.html#WhoHasThePower\" target=\"_blank\">copyright holders of the software have the power to enforce the GPL</a>, as the license is a copyright license. Copyright holders are advised to inform developers of the GPL-covered software if they see a violation. With the GPLv2, the only way for license violators to receive back their rights after violation is to <a href=\"https://www.gnu.org/licenses/quick-guide-gplv3.en.html\" target=\"_blank\">petition the copyright holder</a>. Mullenweg has already identified a path to compliance for Wix.</p>\n<p>Although many in the open source community are itching for a definitive court case involving the GPL, Mullenweg said his preferred outcome is to see Wix open source its mobile app.</p>\n<p>&#8220;I would much rather they just release their app as GPL rather than have to get into a legal fight,&#8221; he <a href=\"https://ma.tt/2016/10/wix-and-the-gpl/#comment-586279\" target=\"_blank\">replied</a> to commenters on his blog.</p>\n<p>When I asked if he is willing to take the matter to court if Wix does not comply, Mullenweg said, &#8220;We would of course go to court to protect the GPL.&#8221; He also said that if Wix decides to pursue the other avenue, &#8220;removing the library would fix it going forward, but not for things that already infringed.&#8221; Mullenweg could not say what Automattic will or won&#8217;t do in a legal context regarding the past infringement, as the situation is still developing.</p>\n<p>This weekend&#8217;s debate between Mullenweg and Wix sparked discussions across social media platforms as well as blog post responses about how the the GPL affects the industry. It also shows how divisive the license can be even among open source software proponents. Mullenweg, who is known inside the WordPress community as a zealous defender of the GPL, has demonstrated a willingness to go to battle over <a href=\"https://wptavern.com/mullenweg-and-pearson-square-off-on-patents-gpl-and-trademarks\" target=\"_blank\">violations of the license in the past</a>.</p>\n<p>Many in the WordPress and Wix communities took issue with the public handling of the matter, but ultimately the controversy is not a personal matter between Mullenweg and Wix. The proprietary mobile app distributes GPL code that was the work of many contributors. WordPress&#8217; open source code was built from the hard work of people who were willing to give that time and energy because they believe in the project and the freedoms that its license guarantees. Wix&#8217;s disrespect of that license illegally co-opts those contributions for the company&#8217;s closed source app.</p>\n<h3>&#8220;My program will have liberty, or never be born.&#8221;</h3>\n<p>The GPL license is holistic in the sense that all parts of an application are connected &#8211; if one part bears the freedoms of the GPL, the entire app benefits from the GPL and must be therefore be open for all. The GPL is the reason WordPress exists and the reason why Mullenweg is so passionate about it. If b2/cafelog had not been GPL-licensed, Matt Mullenweg and Mike Little would not have been able to <a href=\"https://ma.tt/2003/01/the-blogging-software-dilemma/\" target=\"_blank\">build on it</a>.</p>\n<p>One of the questions in the GNU GPL FAQ asks, &#8220;<a href=\"https://www.gnu.org/licenses/gpl-faq.en.html#WhatIfSchool\" target=\"_blank\">What if my school might want to make my program into its own proprietary software product?</a>&#8221; This question addresses how many universities try to restrict the use of the knowledge and information they (and their students) develop, a problem that also exists in commercial businesses. The GNU recommendation for developers wanting to ensure their software is allowed to be GPL licensed is to raise the issue at the earliest possible stage for the most leverage:</p>\n<blockquote><p>So we recommend that you approach them when the program is only half-done, saying, &#8216;If you will agree to releasing this as free software, I will finish it.&#8217; Don&#8217;t think of this as a bluff. To prevail, you must have the courage to say, <strong>&#8216;My program will have liberty, or never be born.&#8217;</strong></p></blockquote>\n<p>This powerful sentiment is one that many GPL software contributors have adopted as a way of life. They contribute code on the basis that it will be passed on with all its freedoms. Taking GPL-licensed code and putting it in a proprietary app is an affront to their contributions.</p>\n<p>Wix CEO Avishai Abrahami&#8217;s casual response identifies both parties as open source proponents who are working to make the web a better place. This response misses the mark because it fails to recognize WordPress&#8217; 13-year history with the GPL and how deeply it has impacted the software&#8217;s trajectory and ability to make the web a better, more open place. This license and WordPress&#8217; commitment to user freedoms has been the project&#8217;s true north from its inception.</p>\n<p>When a project is given the GPL license, it makes that code and the license&#8217;s freedoms inseparable. Essentially, that code isn&#8217;t legally available to anyone without those freedoms in place. Regardless of whether Wix&#8217;s deflection of the issue is motivated by ignorance of the GPL or malicious intent, the company has to answer for its misuse of the software. The ball is now in Wix&#8217;s court &#8211; to comply with what the GPL license requires or take its own interpretation to court.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 31 Oct 2016 21:23:33 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Matt: Apples TV’s Struggles\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=46916\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"https://ma.tt/2016/10/apples-tvs-struggles/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:983:\"<p><a href=\"http://joe-steel.com/2016-10-28-Apples-October-TV-Surprise.html\"><img class=\"  wp-image-46924 alignright\" src=\"https://i0.wp.com/ma.tt/files/2016/10/apple-tv.jpg?resize=231%2C201&ssl=1\" alt=\"apple-tv.jpg\" /></a>Joseph Rosensteel has <a href=\"http://joe-steel.com/2016-10-28-Apples-October-TV-Surprise.html\">an outsider but savvy perspective on the updates and technology around Apple TV</a>. Definitely a worthwhile read. I&#8217;ve experienced a lot of this frustration myself &#8212; I have a large library of things bought through iTunes, I like the interface of the Apple TV (though I liked the old one a little better), and Airplay is handy, so I want to love the Apple TV. The market is so bad right now that <a href=\"http://thewirecutter.com/reviews/best-media-streamers/\">most review sites like Wirecutter recommend Roku</a>, which for me came with a branded remote button for a service that is out of business (Rdio) and has an interface that feels DOS-like.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 31 Oct 2016 14:45:03 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"Matt: The Wix Mobile App, a WordPress Joint\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=46879\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:38:\"https://ma.tt/2016/10/wix-and-the-gpl/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:12333:\"<p>Anyone who knows me knows that I like to try new things &#8212; phones, gadgets, apps. Last week I downloaded the <a href=\"http://www.prnewswire.com/news-releases/wixcom-launches-wix-app-providing-a-powerful-mobile-operating-system-for-small-business-owners-store-owners-hoteliers-and-bloggers-around-the-world-300339448.html\">new Wix (closed, proprietary, non-open-sourced, non-GPL) mobile app</a>. I’m always interested to see how others tackle the challenge of building and editing websites from a mobile device.</p>\n<p>I started playing around with the editor, and felt… déjà vu. It was familiar. Like I had used it before.</p>\n<p>Turns out I had. Because it’s WordPress.</p>\n<p>If I were being charitable, I’d say, &#8220;The app&#8217;s editor is based on the WordPress mobile app&#8217;s editor.&#8221; If I were being honest, I&#8217;d say that Wix copied WordPress without attribution, credit, or following the license. The custom icons, the class names, even the bugs. You can see the <a href=\"https://github.com/wix/WordPress-Editor-Android\">forked</a><a href=\"https://github.com/wix/react-native-wordpress-editor\"> repositories</a> on GitHub complete with original commits from Alex and Maxime, two developers on Automattic’s mobile team. Wix has always borrowed liberally from WordPress &#8212; including their company name, which used to be Wixpress Ltd. &#8212; but this blatant rip-off and code theft is beyond anything I&#8217;ve seen before from a competitor.</p>\n<h3>Dear Wix,</h3>\n<p>This explicitly contravenes the GPL, which requires attribution and a corresponding GPL license on whatever you release publicly built on top of GPL code. The GPL is what has allowed WordPress to flourish, and that let us create this code. Your app&#8217;s editor is built with stolen code, so your whole app is now in violation of the license.</p>\n<p>I suppose we’ll take this as a compliment &#8212; I’m sure the hundreds of people who have contributed to WordPress Core and our mobile apps are flattered that you chose to build one of your company’s core features using our code. We’re also excited to see what great things you create with all the time you saved not having to write your own mobile editor.</p>\n<p>You know what’d be even more exciting? To see you abide by the GPL and release your source code back to the community that gave you that jump start.</p>\n<p>I’ve always said that <a href=\"https://ma.tt/2014/01/four-freedoms/\">the GPL isn’t about limits, it’s about possibilities</a>. In open source software, you trade some of your control as a developer to better serve the developer community and the people using your sites and products. I don’t think that’s a limit, I think it’s a way to make sure we encourage innovation and momentum. If you want to close the door on innovation, Wix, that’s your decision to make &#8212; just write your own code. If you’re going to join the open source community, play by the open source rules.</p>\n<p>Release your app under the GPL, and put the source code for your app up on GitHub so that we can all build on it, improve it, and learn from it.</p>\n<p>Love,<br />\nMatt and the open source community</p>\n<h3>An Update</h3>\n<p>The <a href=\"http://www.wix.com/blog/2016/10/dear-matt-mullenweg-an-open-letter-from-wix-coms-ceo-avishai-abrahami/\">CEO of Wix has posted a response on their blog</a>. I&#8217;ll also try to post my response it to the comments there. <a href=\"http://wpgarage.com/news-views/weak-wix-response-wordpress-gpl/\">Miriam Schwab also has a very good response</a>.</p>\n<blockquote><p>We were all very surprised by your post, as you have so many claims against us.</p>\n<p>Wow, dude I did not even know we were fighting.</p></blockquote>\n<p>It&#8217;s not a fight: the claim is that the Wix mobile apps distribute GPL code and aren&#8217;t themselves GPL, so they violate the license.</p>\n<blockquote><p>First, you say we have been taking from the open source community without giving back, well, of course, that isn’t true. Here is a list of 224 projects on our public <a href=\"https://github.com/wix\" target=\"_blank\">GitHub page</a>, and as you can see they are all dated before your post. We have not checked if WordPress is using them, but you are more than welcome to do so, some of them are pretty good.</p></blockquote>\n<p>Very glad your company has projects on GitHub! Thank you for the offer to use them; if we do, we&#8217;ll make sure to follow the license you&#8217;ve put on the code very carefully.</p>\n<p>Releasing other open source projects doesn&#8217;t mean that you can violate the license of the editor code you distributed in your mobile apps. To repeat my earlier points: since you distributed GPL code with your apps, the entire apps need to be released at GPL, not just your modifications to that one library.</p>\n<p>As <a href=\"https://news.ycombinator.com/item?id=12828814\">this Hacker News comment put it</a>, &#8220;Open source is not a swap meet; you can&#8217;t violate a license if you voluntarily release some other code to make up for it.&#8221;</p>\n<blockquote><p>We always shared and admired your commitment to give back, which is exactly why we have those 224 open source projects, and thousands more bugs/improvements available to the open source community and we will release the app you saw as well.</p></blockquote>\n<p>If you were to release the entire source code of the apps under GPL that would bring you back into compliance with the license you violated. I <em>think</em> you&#8217;re saying you will do that here, but can you clarify? When should we look for the app code to be released, and where? That would resolve this issue completely.</p>\n<blockquote><p>Next, you talk about the Wix App being stolen from WordPress. There are more than 3 million lines of code in the Wix application, notably the hotels/blogs/chat/eCommerce/scheduling/booking is all our code.</p></blockquote>\n<p>I said the app includes stolen code. It doesn&#8217;t matter if it&#8217;s 30 lines or 30 million lines: because it includes GPL code and you distributed the app, the entire thing needs to be GPL. If you release the entire app&#8217;s code, as I think you said you would, then that resolves the license violation.</p>\n<blockquote><p>Yes, we did use the WordPress open source library for a minor part of the application (that is the concept of open source right?), and everything we improved there or modified, we submitted back as open source, see here in this <a href=\"https://github.com/wix/react-native-wordpress-editor\" target=\"_blank\">link</a> – you should check it out, pretty cool way of using it on mobile native. I really think you guys can use it with your app (and it is open source, so you are welcome to use it for free). And, by the way, the part that we used was in fact developed by another and modified by you.</p></blockquote>\n<p>Thank you for admitting you used the code and not trying to hide it. The issue isn&#8217;t the changes you made, it&#8217;s that including the editor means you need to submit the entire app as open source, which you have not yet &#8212; it&#8217;s completely proprietary.</p>\n<blockquote><p>If you want to read the account from Tal Kol, one of the leading engineers on this project, <a href=\"https://medium.com/@talkol/how-i-found-myself-accused-of-stealing-code-from-wordpress-a7350da9f9f2#.7yyylkagl\" target=\"_blank\">here it is</a>. He was really happy to share his side of the story.</p></blockquote>\n<p>I have seen it, and it <a href=\"https://medium.com/@csu/can-you-address-this-point-made-in-matts-post-this-explicitly-contravenes-the-gpl-which-7b6460b5b3e1\">already has a number of good comments on it, including this one</a>: &#8220;Can you address this point made in Matt’s post: &#8216;This explicitly contravenes the GPL, which requires attribution and a corresponding GPL license on whatever you release publicly built on top of GPL code&#8217;.&#8221; It appears you and Tal might share a misunderstanding of how the GPL works &#8212; software licensing can be tricky and many people make honest mistakes. (If you want to get into serious detail, <a href=\"https://ma.tt/2016/10/wix-and-the-gpl/#comment-586319\">this comment</a> lays the licensing requirements out clearly.) It is easy to rectify this one: release your apps as open source under the GPL.</p>\n<blockquote><p>Now, what is this thing about us stealing your branding? Our product was always called Wix and our website Wix.com, we never borrowed from your marketing or brand.</p></blockquote>\n<p>Sorry for including this distraction; I was referring specifically to the fact that Wix used to go by &#8220;Wixpress.&#8221; You can see this <a href=\"http://files.shareholder.com/downloads/AMDA-29IDMU/0x0xS1193125-13-387285/1576789/filing.pdf\">in your Form F-1</a>, and there used to be a support page about this on your site:</p>\n<p><img class=\"aligncenter size-full wp-image-46910\" src=\"https://i0.wp.com/ma.tt/files/2016/10/Screen-Shot-2016-10-30-at-3.12.19-AM.png?resize=604%2C94&ssl=1\" alt=\"\" /></p>\n<p>Although that is still in Google, the <a href=\"https://www.wix.com/support/html5/ugc/62ae9410-79d0-4198-8ff1-4a37966e1e94/0d1a19e1-c862-44e4-a9d6-bc813f8a9207\">page</a> it links to <a href=\"https://cloudup.com/cu5miENIoLl\">now mysteriously returns a 404 error</a>, which you may want to look into.</p>\n<blockquote><p>In fact, if I remember correctly, until recently the Automattic home page was all about blogs and only recently it has become “websites.” Also, your business model changed to almost exactly the one we had for years. Can it be that you guys are borrowing from us? If so, again, you are welcome to it.</p></blockquote>\n<p>The <a href=\"http://automattic.com/\">Automattic home page</a> has been a series of haiku about our products <a href=\"http://web.archive.org/web/20121218130226/http://wordpress.com/\">since 2009</a>, pretty much unchanged &#8212; I think you mean the WordPress.com home page here. WordPress has been used for creating websites, not just blogs, since <a href=\"https://wordpress.org/news/2005/02/strayhorn/\">our 1.5 release in 2005 added themes and pages</a>. In my <a href=\"https://ma.tt/2014/10/sotw-2014/\">2014 State of the Word address</a> I talked about how 87% of WordPress sites use it as a CMS. We regularly test dozens of variations of the WP.com homepage and some of them definitely emphasize website creation. I will say we look to Wix, Weebly, and Squarespace as innovators in the space with products that reach many small businesses, and Wix especially should be commended for its success and growth as a public company.</p>\n<blockquote><p>If you believe that we need to give you credit, that you deserve credit, I must say, absolutely yes. You guys deserve a lot of credit, but not because of a few lines of source code, you deserve credit because you guys have been making the internet dramatically better, and for that we at Wix are big fans. We love what you have been trying to do, and are working very hard to add our own contribution to make the internet better.</p></blockquote>\n<p>Thank you very much, that is kind. I do think there are a lot of values we share in common and would love to see this one issue resolved.</p>\n<blockquote><p>If you need source code that we have, and we have not yet released, then, most likely we will be happy to share, you only need to ask. We share your belief that making the internet better, is best for everyone.</p></blockquote>\n<p>That&#8217;s what my post was asking, for you to release the code. To quote my original letter: &#8220;Release your app under the GPL, and put the source code for your app up on GitHub so that we can all build on it, improve it, and learn from it.&#8221;</p>\n<blockquote><p>Finally, during the last couple of years, I reached out a couple of times trying to meet with you. Could I do that again here? I believe in friendly competition, and as much fun as it is to chat over the blogosphere, maybe we can also do it over a cup of coffee?</p></blockquote>\n<p>Once this is resolved I&#8217;d be happy to meet up. I believe when we exchanged emails in 2014 there was trouble finding overlap in our travel schedules.</p>\n<p>I hope the above clarifies where we think Wix made a mistake, and how to fix it.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 28 Oct 2016 19:45:18 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Matt: Kanye McDonald’s Poem\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=46881\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"https://ma.tt/2016/10/kanye-mcdonalds-poem/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:302:\"<p>You might need a reason to smile today. If so, <a href=\"http://www.theverge.com/tldr/2016/8/22/12586016/kanye-west-mcdonalds-poem-frank-ocean-boys-dont-cry-zine\">Kanye&#8217;s poem for Frank Ocean&#8217;s Boys Don&#8217;t Cry zine, illustrated by Dami Lee at the Verge</a>, might be that reason.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 28 Oct 2016 19:30:29 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"WPTavern: WordPress 4.7 Removes the Underline and Justify Buttons From the Editor\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=63314\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"https://wptavern.com/wordpress-4-7-removes-the-underline-and-justify-buttons-from-the-editor\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2298:\"<p>Back in August, we highlighted <a href=\"https://wptavern.com/improving-the-user-experience-by-rearranging-the-wordpress-post-editor\">potential changes</a> to the WordPress editor that would improve the user experience. The team has since <a href=\"https://make.wordpress.org/core/2016/10/28/editor-changes-in-4-7/\">implemented</a> some of the suggestions outlined in <a href=\"https://core.trac.wordpress.org/ticket/27159\">ticket #27159</a> into WordPress 4.7, including rearranging some of the toolbar buttons. The headers drop-down menu is now in the top row of buttons while the strikethrough and horizontal rule buttons are on the second row.</p>\n<p>The underline and justify buttons are no longer available. According to Andrew Ozz, who primarily works on the TinyMCE editor in WordPress, underlining text causes confusion as readers may interpret it as a link. The justify button was removed because it has uneven browser implementation and often makes text less readable. However, keyboard shortcuts for both buttons will continue to work in 4.7.</p>\n<a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/08/WP46FreshInstallPostEditor.png?ssl=1\"><img class=\"size-full wp-image-60457\" src=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/08/WP46FreshInstallPostEditor.png?resize=573%2C396&ssl=1\" alt=\"WordPress 4.6 Post Editor\" /></a>WordPress 4.6 Post Editor\n<a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/10/WordPress47PostEditor.png?ssl=1\"><img class=\"size-full wp-image-63316\" src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/10/WordPress47PostEditor.png?resize=637%2C248&ssl=1\" alt=\"WordPress 4.7 Post Editor\" /></a>WordPress 4.7 Post Editor\n<p>In addition to these changes, tooltips that appear when hovering over a button will display the keyboard shortcut making them easier to discover.</p>\n<p>Since WordPress does not track which buttons are used most often the team can not accurately measure the impact these changes will have. Users are encouraged to test <a href=\"https://wptavern.com/wordpress-4-7-beta-1-now-available-for-testing\">WordPress 4.7 beta 1</a> and share your feedback on the <a href=\"https://wordpress.org/support/forum/alphabeta/\">Alpha/Beta</a> section of the support forums.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 28 Oct 2016 17:12:07 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"WPTavern: WordPress 4.7 Beta 1 Now Available for Testing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=63291\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://wptavern.com/wordpress-4-7-beta-1-now-available-for-testing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2558:\"<p>WordPress 4.7 <a href=\"https://wordpress.org/news/2016/10/wordpress-4-7-beta-1/\" target=\"_blank\">Beta 1</a> was released this evening with a long list of highlighted features that are certain to delight both end users and developers. Core contributors are asking for testing and feedback on some of the larger items ahead of the official release, slated for <a href=\"https://make.wordpress.org/core/4-7/\" target=\"_blank\">December 6</a>.</p>\n<p>Twenty Seventeen and its support for atmospheric videos is one of the major front-facing features in 4.7 that could use testing. Last week, when <a href=\"https://wptavern.com/new-wordpress-default-theme-twenty-seventeen-merged-into-4-7\" target=\"_blank\">Twenty Seventeen was merged</a>, there was some uncertainty as to whether or not the first version would ship with video headers. Contributors knuckled down and worked quickly to get basic <a href=\"https://core.trac.wordpress.org/ticket/38172\" target=\"_blank\">core support for video headers</a> ready for an initial commit.</p>\n<p>Twenty Seventeen will be the first WordPress theme to use the new feature. Users will be able to manage video headers in the customizer by selecting a video via the media library or setting a URL to an external video, such as one hosted on YouTube. Theme authors who want to add support for videos will be able to do so by passing &#8216;video&#8217; => true as an argument when adding theme support for custom headers. If the browser is unable to play the video, it will fallback to the header image.</p>\n<p>Other user-facing features that require testing include:</p>\n<ul>\n<li>New site setup flow</li>\n<li>Custom CSS with live previews</li>\n<li>User admin languages</li>\n<li>PDF thumbnail previews</li>\n</ul>\n<p>WordPress 4.7 release lead Helen Hou-Sandí also requested that plugin and theme developers test the REST API content endpoints, any plugins that might be impacted by the <a href=\"https://make.wordpress.org/core/2016/09/08/wp_hook-next-generation-actions-and-filters/\" target=\"_blank\">WP_Hook overhaul</a>, the expanded Settings Registration API, custom bulk actions, post type templates, and a few other items.</p>\n<p>With the impressive list of features on deck for 4.7, it&#8217;s only fitting that Beta 1 was accompanied by an extended five-stanza haiku. Check out the <a href=\"https://wordpress.org/news/2016/10/wordpress-4-7-beta-1/\" target=\"_blank\">announcement post</a> to read the haiku and find more information on how to test changes coming in the next release.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 28 Oct 2016 06:01:11 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"WPTavern: WordPress 4.7 Brings Custom Page Template Functionality to All Post Types\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=63284\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"https://wptavern.com/wordpress-4-7-brings-custom-page-template-functionality-to-all-post-types\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3231:\"<a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/colored-pencils.jpg?ssl=1\"><img src=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/colored-pencils.jpg?resize=1025%2C464&ssl=1\" alt=\"photo credit: Mari Pi\" class=\"size-full wp-image-50851\" /></a>photo credit: <a href=\"https://stocksnap.io/photo/7MBZIHU7O7\">Mari Pi</a>\n<p>WordPress 4.7 will <a href=\"https://core.trac.wordpress.org/changeset/38951\" target=\"_blank\">introduce support for post type templates</a>, an exciting new feature for theme and plugin developers. <a href=\"https://developer.wordpress.org/themes/template-files-section/page-template-files/page-templates/\" target=\"_blank\">Page templates</a>, which allow developers to specify a different layout or design for a page, are nearly as old as WordPress itself. For years developers have coveted that same functionality for other post types. In fact, a plugin that attempted to create this functionality (<a href=\"https://wordpress.org/plugins/custom-post-template/\" target=\"_blank\">Custom Post Template</a>), has more than 50,000 active installs, despite not having been updated for four years.</p>\n<p>Post type templates follow a format similar to that of the existing custom page templates. The author can specify a template name as well as the post types where the template will be available as a dropdown in the page attributes metabox.</p>\n<p><code>/*<br />\n * Template Name: Foggy Memories<br />\n * Template Type: memory, event<br />\n */</code></p>\n<p>The current implementation of post type templates can be used with any post type that supports page-attributes, which means that it will not work with regular posts by default. I think they would be more immediately useful for the average user who likes to tinker with templates if they worked with posts by default, but the assumption is that developers are likely the ones who will be implementing post type templates.</p>\n<p>The <a href=\"https://core.trac.wordpress.org/ticket/18375\" target=\"_blank\">ticket</a> for the feature, which was opened four years ago, includes many potential use cases. One developer was building a project involving landing pages that were set up as custom post types. He needed to have multiple templates for the landing pages but had to create a work around since post type templates were not yet available.</p>\n<p>Another developer wanted to make a distinction between posts with guest contributors versus those coming from regular writers, such as displaying author boxes and avatars. Since this project was for a client, an implementation involving post templates would make it easy to assign the different designs via the dropdown in the post attributes metabox.</p>\n<p>&#8220;By opening up the page template functionality to all post types, we continue to improve the template hierarchy&#8217;s flexibility,&#8221; WordPress core committer Pascal Birchler said in his commit message. This new feature opens up many new avenues of customization for theme developers who want to offer alternative layouts and designs for posts. It also makes it easy to include multiple designs (inside a theme) for specific custom post types that a theme will support.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 28 Oct 2016 04:35:50 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"Dev Blog: WordPress 4.7 Beta 1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=4535\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://wordpress.org/news/2016/10/wordpress-4-7-beta-1/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6878:\"<p>WordPress 4.7 Beta 1 is now available!</p>\n<p><strong>This software is still in development,</strong> so we don’t recommend you run it on a production site. Consider setting up a test site just to play with the new version. To test WordPress 4.7, try the <a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a> plugin (you’ll want “bleeding edge nightlies”). Or you can <a href=\"https://wordpress.org/wordpress-4.7-beta1.zip\">download the beta here</a> (zip).</p>\n<p>WordPress 4.7 is slated for release on <a href=\"https://make.wordpress.org/core/4-7/\">December 6</a>, but we need your help to get there. We&#8217;ve been working on a lot of things, many of them to make getting your site set up the way you want it much easier. Here are some of the bigger items to test and help us find as many bugs as possible in the coming weeks:</p>\n<ul>\n<li><a href=\"http://2017.wordpress.net/\"><strong>Twenty Seventeen</strong></a> &#8211; A brand new default theme brings your site to life with immersive featured images, video headers, and subtle animations. With a focus on business sites, it features multiple sections on the front page as well as widgets, navigation and social menus, a logo, and more. Personalize its asymmetrical grid with a custom color scheme and showcase your multimedia content with post formats. Our default theme for 2017 works great in many languages, for any abilities, and on any device.</li>\n<li><strong>Video Headers</strong> &#8211; Sometimes a big atmospheric video as a moving header image is just what you need to showcase your wares; go ahead and try it out with Twenty Seventeen. Need some video inspiration? Try searching for sites with video headers available for download and use.</li>\n<li><strong>Set up your site in one flow</strong> &#8211; From finding and installing themes right inside the customizer, to automatically staged theme-specific starter content, to clickable shortcuts that jump directly to editing an item from the preview pane, to adding pages while you&#8217;re building a nav menu or setting a static front page: getting a new site spun up and ready to share with a friend or a coworker is faster and easier than it&#8217;s ever been. Note: starter content appears when live previewing brand new sites and is currently only available in Twenty Seventeen. We&#8217;ll be expanding this to other bundled themes very soon, and perhaps to sites with existing content in future releases of WordPress.</li>\n<li><strong>Custom CSS with live previews</strong> &#8211; Ever needed to hide or tweak the look of something in your theme or from a plugin? Now you can do it with CSS and live preview the results while customizing your site. CSS can be a powerful tool; you may find that you won&#8217;t need the theme editor or child themes anymore.</li>\n<li><strong>User admin languages</strong> &#8211; Just because your site is in one language doesn&#8217;t mean that everybody helping manage it prefers that language for their admin. To try this out, you&#8217;ll need to have more than one language installed, which will make a user language option available in your profile.</li>\n<li><strong>PDF thumbnail previews</strong> &#8211; Uploading PDFs will now generate thumbnail images so you can more easily distinguish between all your documents.</li>\n</ul>\n<p>As always, there have been exciting changes for developers to explore as well, such as:</p>\n<ul>\n<li><strong>REST API content endpoints</strong> &#8211; If you only test one thing as a developer, please test these. This phase is particularly helpful for people building plugins, themes, and in-admin interfaces. Can you build the things you need? Are these ready for release, and is the world ready for them? (<a href=\"https://core.trac.wordpress.org/ticket/38373\">#38373</a>)</li>\n<li><strong><code>WP_Hook</code></strong> &#8211; The code that lies beneath actions and filters has been overhauled. You likely aren&#8217;t affected, but if you&#8217;ve done things to the <code>$wp_filter</code> global or experienced funky recursion bugs in the past, <a href=\"https://make.wordpress.org/core/2016/09/08/wp_hook-next-generation-actions-and-filters/\">please take a moment to read the dev note</a> and test your code.</li>\n<li><a href=\"https://make.wordpress.org/core/2016/10/04/custom-bulk-actions/\"><strong>Custom bulk actions</strong></a> &#8211; List tables, now with more than bulk edit and delete.</li>\n<li>Expanded <a href=\"https://make.wordpress.org/core/2016/10/26/registering-your-settings-in-wordpress-4-7/\"><strong>Settings Registration API</strong></a> via <code>register_setting()</code>.</li>\n<li>For theme developers: <strong>Post type templates</strong> (<a href=\"https://core.trac.wordpress.org/ticket/18375\">#18375</a>)</li>\n<li><strong><a href=\"https://make.wordpress.org/core/2016/09/09/new-functions-hooks-and-behaviour-for-theme-developers-in-wordpress-4-7/\">More goodies for theme developers!</a></strong></li>\n<li><strong>Locale switching</strong> (<a href=\"https://core.trac.wordpress.org/ticket/26511\">#26511</a>)</li>\n<li><a href=\"https://make.wordpress.org/core/2016/10/11/comment-allowed-checks-in-wordpress-4-7/\"><strong>Comment allowed checks</strong></a> have the potential for a back-compat break.</li>\n</ul>\n<p>If you want a more in-depth view of what major changes have made it into 4.7, <a href=\"https://make.wordpress.org/core/tag/4-7/\">check out posts tagged with 4.7 on the main development blog</a>, or look at a <a href=\"https://core.trac.wordpress.org/query?status=closed&resolution=fixed&milestone=4.7&group=component&order=priority\">list of everything</a> that’s changed. There will be more developer notes to come, so keep an eye out for those as well.</p>\n<p><strong>If you think you’ve found a bug</strong>, you can post to the <a href=\"https://wordpress.org/support/forum/alphabeta\">Alpha/Beta area</a> in the support forums. We’d love to hear from you! If you’re comfortable writing a reproducible bug report, <a href=\"https://make.wordpress.org/core/reports/\">file one on WordPress Trac</a>, where you can also find <a href=\"https://core.trac.wordpress.org/tickets/major\">a list of known bugs</a>.</p>\n<p>Happy testing, and please enjoy this extended haiku break, courtesy of <a href=\"https://profiles.wordpress.org/ramiabraham\">Rami Abraham</a><em>.</em></p>\n<p><em>Exquisite endpoints</em><br />\n<em>Extol epic exabytes</em><br />\n<em>Enabling earthlings</em></p>\n<p><em>Careful interfaces</em><br />\n<em>Considerately conjured</em><br />\n<em>Customizer chic</em></p>\n<p><em>Ring in the new year</em><br />\n<em>With elegance and balance</em><br />\n<em>Twenty Seventeen</em></p>\n<p><em>Hooks hook healthily</em><br />\n<em>17817</em><br />\n<em>Sane iterations</em></p>\n<p><em>Admin in your tongue<br />\nOne site, many languages<br />\nWe all speak WordPress</em></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 28 Oct 2016 04:30:27 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Helen Hou-Sandi\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"WPTavern: WPWeekly Episode 252 – Flywheel Hosting Three Years Later\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://wptavern.com?p=63280&preview=true&preview_id=63280\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"https://wptavern.com/wpweekly-episode-252-flywheel-hosting-three-years-later\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2843:\"<p>In this episode of WordPress Weekly, <a href=\"http://marcuscouch.com/\">Marcus Couch</a> and I are joined by Dusty Davidson, co-founder and CEO of <a href=\"http://getflywheel.com/\">Flywheel</a>, a managed WordPress hosting company that caters to agencies and designers. Davidson last appeared on the show <a href=\"https://wptavern.com/wpweekly-episode-118-hey-get-flywheel\">three years ago</a> when the company had yet to launch to the public.</p>\n<p>In the interview, Davidson tells us what he&#8217;s learned in the three years since launching the company. We discuss current trends in the industry and how hosting providers are affecting the WordPress ecosystem.</p>\n<p>Davidson explains how the company maintains its stellar reputation for customer support and the impacts of being listed on the WordPress.org <a href=\"https://wordpress.org/hosting/\">recommended hosting</a> page. Near the end of the interview, we learn how Flywheel is implementing <a href=\"https://letsencrypt.org/\">Let&#8217;s Encrypt</a> to easily provide SSL certificates for customers.</p>\n<h2>Stories Discussed:</h2>\n<p><a href=\"https://wptavern.com/linkedin-learning-is-offering-free-access-this-week-to-its-library-of-more-than-5000-courses\">LinkedIn Learning Is Offering Free Access This Week to Its Library of More Than 5,000 Courses</a></p>\n<h2>Plugins Picked By Marcus:</h2>\n<p><a href=\"https://wordpress.org/plugins/import-meetup-events/\">Import Meetup Events</a> is an add-on for The Events Calendar and Events Manager plugins. It allows you to automatically import events from Meetup.com into The Events Calendar or Events Manager.</p>\n<p><a href=\"https://wordpress.org/plugins/click-to-clipboard/\">Click to Clipboard</a> allows you to copy paragraphs from your site&#8217;s main content to the clipboard to use elsewhere.</p>\n<p><a href=\"https://wordpress.org/plugins/archive-control/\">Archive Control</a> allows you to customize your archive listing by modifying your Archive title, adding a featured image, including content before or after the list. You can also change the order of display and include pagination, adjust the terms, and more.</p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, November 2nd 9:30 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"https://wptavern.com/feed/podcast\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #252:</strong><br />\n</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 27 Oct 2016 22:35:18 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"WPTavern: The Challenges of Organizing a WordCamp From Abroad\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=63151\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"https://wptavern.com/the-challenges-of-organizing-a-wordcamp-from-abroad\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3591:\"<p>Earlier this year, a <a href=\"https://wptavern.com/wordpress-to-launch-experimental-wordcamp-incubator-program\">WordCamp incubator program</a> was created to help three cities establish their first WordCamp. After <a href=\"https://wptavern.com/wordcamp-incubator-program-to-launch-in-indonesia-zimbabwe-and-columbia\">receiving 182 applications</a>, the three cities selected for the program were:</p>\n<ul>\n<li>Denpasar, Indonesia</li>\n<li>Harare, Zimbabwe</li>\n<li>Medellín, Colombia</li>\n</ul>\n<p><a href=\"https://2016.medellin.wordcamp.org/\">WordCamp Medellín</a> is scheduled for November 5th and is the first of the three incubator events to take place. Andrea Middleton, Community Organizer for the WordPress open source project, is part of the organizing team and says organizing a camp from the other side of the world is challenging.</p>\n<p>&#8220;The local community is still quite loose/unstructured and there isn&#8217;t a very well-established group of local leaders, so it&#8217;s been an interesting exercise in finding local organizers, speakers, and volunteers,&#8221; Middleton told the Tavern.</p>\n<p>The organizing team consists of a U.S. expatriate who recently moved to the area, a Colombian who now lives in Spain, three locals, two members of the WordCamp Lima team who are lending their experience, and Middleton.</p>\n<p>Spanish is the primary language in Medellín which can present communication challenges. I asked Middleton if she needs to use a translator to communicate to the team, &#8220;I lived in Mexico for 5 years back in the 90s so my Spanish is passable, but it&#8217;s a pretty bilingual group,&#8221; Middleton said.</p>\n<p>&#8220;The last meeting was in English but most of our text interaction is in Spanish to accommodate the Colombians who are not proficient in English.</p>\n<p>&#8220;I ask native Spanish speakers to review and or correct my written Spanish when I&#8217;m publishing content to the site. I&#8217;m the primary venue contact and all of that has been in Spanish over email.&#8221;</p>\n<p>According to Middleton, WhatsApp is huge in Colombia but is not ideal for collaborating with members of WordCamp Central since the team uses Slack. So half of the communication is on WhatsApp while the other is conducted on a free Slack instance.</p>\n<p>WordCamp Medellín&#8217;s <a href=\"https://2016.medellin.wordcamp.org/programa/\">schedule</a> includes sessions by local entrepreneurs on how to contribute to WordPress, Multilingual WordPress, and SEO. The opening session features a 15 year-old speaker.</p>\n<p>Thanks to considerable effort on the part of Middleton, the event has a female speaker, &#8220;We had no female speaker applicants, so I poured over the list of women who had attended the meetups and then researched them and recruited them to speak,&#8221; Middleton said. &#8220;It only ended up with one local female speaker, but I think she&#8217;s going to be great.&#8221;</p>\n<p>Middleton says that when the event concludes, she&#8217;ll publish a post detailing the things she&#8217;s learned organizing a WordCamp from abroad. Tickets are <a href=\"https://2016.medellin.wordcamp.org/registro/\">still on sale</a> for <a href=\"https://2016.medellin.wordcamp.org/\">WordCamp Medellín</a> at $10 each and includes lunch and a shirt.</p>\n<p>To learn more about Middleton&#8217;s role in WordCamps and the incubator program, listen to <a href=\"https://wptavern.com/wpweekly-episode-234-all-things-wordcamp-with-andrea-middleton\">episode 234</a> of WordPress Weekly.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 26 Oct 2016 21:11:27 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:10;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:104:\"WPTavern: Controversy Surrounding WordPress.org “Popular” Themes Exposes Weaknesses in the Algorithm\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=63129\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:109:\"https://wptavern.com/controversy-surrounding-wordpress-org-popular-themes-exposes-weaknesses-in-the-algorithm\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:10973:\"<a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2015/07/chart.jpg?ssl=1\"><img src=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2015/07/chart.jpg?resize=1025%2C511&ssl=1\" alt=\"photo credit:  Luis Llerena\" class=\"size-full wp-image-46313\" /></a>photo credit:  <a href=\"https://stocksnap.io/photo/S3JE5YAMND\">Luis Llerena</a>\n<p>If you&#8217;ve ever wondered how the <a href=\"https://wordpress.org/themes/\" target=\"_blank\">WordPress Theme Directory</a> identifies and ranks the themes that display under the popular tab, you might be surprised to learn that it has nothing to do with ratings. Popularity is a somewhat subjective quality to measure in the first place, but WordPress.org has an algorithm in place to give users an idea of which themes are trending.</p>\n<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/10/theme-directory-popular-tab.png?ssl=1\"><img src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/10/theme-directory-popular-tab.png?resize=1025%2C775&ssl=1\" alt=\"theme-directory-popular-tab\" class=\"aligncenter size-full wp-image-63133\" /></a></p>\n<p>The number of sites using a theme is the first metric that comes to mind for popularity, but it cannot be limited to that or else the results might be skewed towards older themes that are not in fact popular anymore. Samuel &#8220;Otto&#8221; Wood, in response to a <a href=\"https://twitter.com/mattmedeiros/status/791009700171087872\" target=\"_blank\">Twitter thread</a> about how themes appear to be gaming the system, created a <a href=\"https://www.youtube.com/watch?v=hwFscqBOiOY&feature=youtu.be\" target=\"_blank\">video</a> to explain how the popularity algorithm works.</p>\n<p>&#8220;Popular is currently active installs divided by age of the theme and a few other factors,&#8221; Wood said. &#8220;Ratings don&#8217;t currently factor into it. We&#8217;re trying to work out an algorithm to add ratings to it. For the most part it&#8217;s a popularity thing.&#8221;</p>\n<p>I asked him for more clarification on the other factors and he said it varies depending on what data they have and how that data looks over time. &#8220;We adjust it to have it change fairly regularly, but still reflecting what is popular at the time,&#8221; Wood said.</p>\n<p>Dion Hulse, who also helps maintain WordPress.org infrastructure, said, &#8220;It&#8217;s not published by design, to hopefully prevent authors gaming it too much. Other than what Otto has said, they only other public part of it is that a theme must be at least two weeks old to be included in the popular rankings.&#8221;</p>\n<p>At the end of last year, <a href=\"https://wptavern.com/the-wordpress-theme-directory-replaces-download-counts-with-the-number-of-active-installs\" target=\"_blank\">theme download counts were replaced with the number of active installs</a> to try to prevent theme authors from gaming the system in order to appear on the Popular tab. Gaming the system is much more difficult now but there are other ways to do it, due to the imperfect measurements for active installs.</p>\n<h3>How WordPress.org Measures Active Installs for Themes</h3>\n<p>The topic of active installs was re-ignited yesterday by Matt Medeiros, a small business owner and <a href=\"https://wordpress.org/themes/author/slocumstudio/\" target=\"_blank\">WordPress.org theme author</a>, who suspected the author of a recently popular theme of gaming the system.</p>\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Gaming .org theme downloads/active is running rampant. This theme “already has 10k active installs.” DL count roughly 3k <a href=\"https://twitter.com/Otto42\">@Otto42</a> <a href=\"https://t.co/aaYwWcsvu8\">pic.twitter.com/aaYwWcsvu8</a></p>\n<p>&mdash; Matt Medeiros (@mattmedeiros) <a href=\"https://twitter.com/mattmedeiros/status/790940338030608384\">October 25, 2016</a></p></blockquote>\n<p></p>\n<p>The <a href=\"https://wordpress.org/themes/vertex/\" target=\"_blank\">Vertex</a> theme, new to the directory this month, already has more than 10,000 active installs, despite having a much lower download count and no ratings. Medeiros made a <a href=\"https://www.youtube.com/watch?v=9XACFOft1hA\" target=\"_blank\">video</a> explaining what he perceived as suspicious activity propelling it to the fourth most popular spot on WordPress.org. This prompted Samuel Wood to film a response, which breaks down some of the flaws in the system that measures active installs.</p>\n<p>&#8220;The active install count is a count of sites that have reported to us that they are checking for an update for that theme and that it is active,&#8221; Wood said. He explained that the 10,000+ in this instance and in many others is a rough estimate because WordPress.org does not have an exact measurement of how many sites have installed a theme:</p>\n<blockquote><p>What we are actually counting is yes, the number of active installs of a theme named Vertex. That may include themes not in our directory, such as this one from Elegant themes. If the theme isn&#8217;t in our directory we still get reports about it. The only way for us to not do that is to have the theme itself that theme check them for updates instead of checking us for updates, which their theme should indeed do. I would go so far as to say that any commercial theme should indeed be checking their commercial site, their systems not ours, but if they don&#8217;t have any special code to handle that case, then yes it will report back to our API server looking for updates. And if it has the name Vertex then yes, it&#8217;s going to be counted as being the Vertex theme. </p></blockquote>\n<p>In this instance, the creators of the Vertex theme were made aware that the name was already in use outside of WordPress.org. They <a href=\"https://themes.trac.wordpress.org/ticket/30317\" target=\"_blank\">offered to change the name of the theme</a> to iVertex during the review process, but the Theme Review Team decided that it wasn&#8217;t necessary.</p>\n<p>&#8220;There&#8217;s no gaming going on behind that,&#8221; Wood said. &#8220;If somebody does game the system, I will find it. I guarantee you. However, this is not such a case. Our current algorithm looks at active installs and if you happen to pick a name that is very popular [outside of WordPress.org], you can have a large number of active installs without it actually being this theme that is being counted.&#8221;</p>\n<p>This problem could be solved with a unique ID for themes. Wood said there is a six-year-old core ticket that he would like to implement, but it&#8217;s not currently a priority.</p>\n<p>&#8220;Unfortunately, there is no real push to do that,&#8221; he said. &#8220;At some point in the future, I would like all themes and plugins in the WordPress directory to get a unique ID which they can put in their headers and when they report back, having that unique ID will uniquely identify that theme or plugin. It would eliminate so many problems for me. It would make updates so much easier. I would be able to do a whole lot of useful things with it and it would let me fix this problem right here.&#8221;</p>\n<h3>How the Popular Themes Algorithm Affects Theme Businesses</h3>\n<p>Getting unique IDs in place is no easy fix, as theme reporting would need to be overhauled and multiple systems that interact with each other would need to be changed. It would be worth it in the long run for more accurate reporting on WordPress.org, which is the first place many users browse when looking for a new theme. If the active install counts are not a proper representation of installations via WordPress.org, then it doesn&#8217;t make sense to pin the popular algorithm to that number.</p>\n<p>I asked Matt Medeiros why he chose to highlight the situation with Vertex, and he explained why many small business owners have a strong interest in the popular themes page.</p>\n<p>&#8220;It’s getting harder and harder to survive as a theme shop these days,&#8221; Medeiros said. &#8220;Indie authors are overshadowed by huge theme shops and mega marketplaces. For me, .org is the only source of distribution for my themes, and I have a  desire to see the repo become the defacto place to find quality themes. Sadly, not all themes are submitted to &#8216;do it right&#8217; and many crop up to make a quick cash grab from unsuspecting end-users. Top spots are worth A LOT of money (see: Zerif) and coupled with an aging search engine for themes, gaming to the top is worth it, even in the short term. Unsuspecting users, who find searching too challenging, settle with what’s in front of them.&#8221;</p>\n<p>Medeiros referenced Zerif Lite, which was recently <a href=\"https://wptavern.com/zerif-lite-suspended-from-wordpress-theme-directory-300k-users-left-without-updates\" target=\"_blank\">removed from WordPress.org</a>, due to violations of guidelines that began to be enforced after the theme was approved. The theme was pulling in tens of thousands of dollars for ThemeIsle, thanks to its frequent spot among the most popular themes on WordPress.org. Ionut Neagu, the company&#8217;s CEO, estimates that Zerif Lite&#8217;s suspension from the directory will diminish the company’s $70K/month revenue by 50%.</p>\n<p>&#8220;There’s a lingering distaste in the review process for freemium upsells,&#8221; Medeiros said. &#8220;Not everyone agrees that folks should have an upsell product here, and that’s unfortunate. As a small business owner, that revenue helps me reinvest into the WordPress community, WordCamps, hire and train people in developing with WordPress. At times the review process, mixed with the emotions of others, feels like a rising tax against the small software business owner, like myself.&#8221;</p>\n<p>When drawing attention to the suspicious active install numbers for the Vertex theme and the flaws in the algorithm, Medeiros drew resistance from Wood, who does not see the directory as a place where businesses should expect a return for their investments.</p>\n<p>&#8220;The theme directory is not an advertisement to peddle your wares,&#8221; Wood <a href=\"https://twitter.com/Otto42/status/790999917451808768\" target=\"_blank\">said</a>. &#8220;It is exactly that sort of thinking [that] makes me want to ban all themes with a &#8216;paid&#8217; version from the directory entirely. The theme directory is not an advertising means. That is not its purpose. If that is your intent, then you are doing it wrong.&#8221;</p>\n<p>Medeiros said he isn&#8217;t interested in reviewing all themes for possible fraud, nor does he expect Otto to do the same. Vertex is just one example among many where the flaws in the algorithm are on public display.</p>\n<p>&#8220;I chose to highlight this issue because I think the repo can be a better choice for users than a for-profit marketplace,&#8221; Medeiros said. &#8220;Either way, I can only hope unearthing this conversation helps affect change for the better.&#8221;</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 26 Oct 2016 20:16:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:11;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"WPTavern: Weglot Multilingual WordPress Plugin Passes €10,000 in Monthly Revenue\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=63048\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"https://wptavern.com/weglot-multilingual-wordpress-plugin-passes-e10000-in-monthly-revenue\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6542:\"<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/10/weglot.jpg?ssl=1\"><img src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/10/weglot.jpg?resize=781%2C350&ssl=1\" alt=\"weglot\" class=\"aligncenter size-full wp-image-63101\" /></a></p>\n<p>Augustin Prot and Rémy Berda, co-founders the <a href=\"https://wordpress.org/plugins/weglot/\" target=\"_blank\">Weglot</a> multilingual plugin for WordPress, started their operation in a small apartment in September 2015. Weglot was originally a simple JavaScript project that offered a language switcher so that users could view websites in different languages. After testers started asking for a solution that could be used with WordPress without causing SEO problems, Weglot co-founders scrapped the JavaScript idea and put all their energies towards creating a WordPress plugin that would follow best practices.</p>\n<p>Berda, the engineer who built the plugin, said he developed it from a &#8220;non-WordPress&#8221; point of view and the team was excited when they started getting one person a day downloading the plugin. They jumped into the WordPress market sight unseen, with no contacts and very little understanding of the community.</p>\n<p>In February 2016, after finishing out the previous month with 291€ in revenue, Weglot co-founders officially launched their <a href=\"https://weglot.com/pricingwp\" target=\"_blank\">SaaS-based commercial offerings</a> to extend the capabilities of the free WordPress.org plugin. They brought the plugin out of beta and decided to sponsor and attend WordCamp Paris to connect with the community.</p>\n<p>&#8220;WordPress was just a name that we had heard of but didn’t know anything about it,&#8221; Berda said. &#8220;Sponsoring the WordCamp was without a doubt what really launched us. Within two days, we had met and exchanged with many people from the WordPress community. After the WordCamp, we started to get more and more users.&#8221;</p>\n<p>I asked Berda what surprised him about WordPress and its commercial ecosystem as someone who was brand new to the community in 2015. He said they knew coming into it that many websites were built on the software but couldn&#8217;t imagine the size or the strength of the community.</p>\n<p>&#8220;We didn&#8217;t imagine that WordPress was so &#8216;community&#8217; based,&#8221; Berda said. &#8220;Events, meetups, WordCamps (in so many cities), blogs, and even a French Slack group.&#8221;</p>\n<p>Berda said he and his co-founder were also surprised by how infrequently the SaaS model is used in the WordPress ecosystem.</p>\n<p>&#8220;People were reluctant to use a SaaS approach at first &#8211; they prefer to buy a piece a software even if it means no support,&#8221; Berda said. &#8220;It was surprising to us because outside WordPress, SaaS has surpassed the &#8216;software&#8217; approach for many reasons. The good thing we&#8217;ve seen is that it changed rapidly between the end of last year and today. It seems the SaaS approach we have is no longer a problem for our users as they understand the value.&#8221;</p>\n<p>In July 2016, Weglot passed €3,500 in monthly revenue, which enabled the team to rent a small office where they could be fully dedicated to the project. Prot and Berda have added a customer support specialist and Weglot&#8217;s monthly recurring revenue is on a steady uphill climb. Last week the plugin <a href=\"http://blog.weglot.com/0-7000euromonthly-beginning-journey/\" target=\"_blank\">passed 5,000 active installs</a> and Berda said they passed 10,000€ per month in actual revenue (7,000€/month in recurring revenue).</p>\n<p>Weglot now has paying customers in 75 countries and Berda gave us a break down of their top seven in terms of MRR (Monthly Recurring revenue):</p>\n<ul>\n<li>France : 20%</li>\n<li>USA : 13%</li>\n<li>UK  : 6.4%</li>\n<li>Spain : 6.3%</li>\n<li>Germany : 4.4%</li>\n<li>Canada : 3.5%</li>\n<li>Italy : 3.4%</li>\n</ul>\n<p>As Weglot&#8217;s founders are French, it isn&#8217;t surprising the product has taken off in France. Over the past few years <a href=\"https://wptavern.com/wordcamp-paris-2014-uniting-the-french-wordpress-community\" target=\"_blank\">the French WordPress community has become more united and connected</a> with WordPress-related events expanding into other cities beyond Paris. The challenges of multilingual publishing is an important topic at these events and other WordCamps around Europe, and Weglot seems to be solving some of these problems for users.</p>\n<p>Compared to more established competitors in the multilingual plugin space, like <a href=\"https://wordpress.org/plugins/polylang/\" target=\"_blank\">Polylang</a> (with 200,000+ active installs) and the 100% commercial <a href=\"https://wpml.org/\" target=\"_blank\">WPML</a> plugin, which boasts a 40-person team, Weglot is still considered a small player. Berda said they hope to distinguish the plugin from its competitors by providing a quicker, simpler setup, a clean approach for SEO, and broader compatibility with WordPress&#8217; ecosystem of themes and plugins.</p>\n<p>&#8220;Weglot has a technical approach that is really different from other plugins,&#8221; Berda said. &#8220;For translated pages, Weglot lets WordPress build the webpage normally and hooks at the end of the code to translate the content. By doing so, Weglot works on a HTML page, making its content source-agnostic and thus solving many compatibility problems.&#8221;</p>\n<p>The plugin also uses rewrite rules to create different URLs for each language offered on the site. For example, <strong>mywebsite.com/contact</strong> returns a page in English, <strong>mywebsite.com/fr/contact</strong> displays the French version, and <strong>mywebsite.com/es/contact</strong> returns the page in Spanish.</p>\n<p>&#8220;This approach combined with adding tags &#8216;alternate&#8217; hreflang in the page, means that Weglot meets <a href=\"https://support.google.com/webmasters/answer/182192?hl=en\" target=\"_blank\">SEO best practices recommended by Google</a>,&#8221; Berda said.</p>\n<p>Apart from finding the right technical approach, Berda said one of the biggest challenges has been maintaining a high level of support. His team has committed to supporting both free and paying customers through forums and live chat. Over the next six months Weglot is aiming to grow its revenue to €20,000/ month, expand its support team, and establish its SaaS approach as a viable business model in the WordPress multilingual plugin space.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 25 Oct 2016 19:56:43 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:12;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:106:\"WPTavern: WordPress and Web Development Communities Get Together to Help Non-Profits at Website Weekend LA\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=63108\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:117:\"https://wptavern.com/wordpress-and-web-development-communities-get-together-to-help-non-profits-at-website-weekend-la\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3114:\"<p>This past weekend, people from the web development and WordPress communities <a href=\"https://wptavern.com/wordpress-to-take-center-stage-during-website-weekend-los-angeles-oct-22-23\">gathered in Los Angeles</a> to attend <a href=\"http://websiteweekend.la/\">Website Weekend LA</a>. Organized by Alex Vasquez and Natalie MacLees, in association with the Los Angeles chapter of <a href=\"https://www.girldevelopit.com/\">Girl Develop It</a>, attendees helped non-profit organizations with their sites.</p>\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">.<a href=\"https://twitter.com/alexjvasquez\">@alexjvasquez</a> and <a href=\"https://twitter.com/nataliemac\">@nataliemac</a> wrapping up a great weekend of talented web folk donating their time to help non-profits. <a href=\"https://twitter.com/hashtag/gdiwwla?src=hash\">#gdiwwla</a> <a href=\"https://twitter.com/hashtag/connect16?src=hash\">#connect16</a> <a href=\"https://t.co/GhQhFq07by\">pic.twitter.com/GhQhFq07by</a></p>\n<p>&mdash; Rachel Carden (@bamadesigner) <a href=\"https://twitter.com/bamadesigner/status/790362187076214784\">October 24, 2016</a></p></blockquote>\n<p></p>\n<p>Roy Sivan, Senior WordPress Developers at Disney, attended the event and <a href=\"https://www.thewpcrowd.com/wordpress/website-weekend-la-recap/\">published a recap</a> on The WP Crowd website. According to Sivan, each organization was assigned a lead developer, 2-3 junior developers, a project manager, and a user experience designer. Sivan&#8217;s team worked on <a href=\"http://thero.org/\">Thero.org</a>, a non-profit in San Diego, CA, that provides mental health resources.</p>\n<p>Sivan&#8217;s team revamped the site&#8217;s search functionality making it similar to <a href=\"http://www.zillow.com/\">Zillow</a>. When visitors search the site, they are taken to a map page that has markers displaying the facility&#8217;s location. The markers also link to their profile on the site. The team also performed optimizations to speed up the site and reworked the donation page to improve its flow.</p>\n<p>Although the event was geared towards non-profits, Sivan says the teams benefited by sharing knowledge with each other, &#8220;I talked to many lead developers through the weekend, and some non-lead,&#8221; Sivan said.</p>\n<p>&#8220;While the non-profits were the main focus for the weekend, we were clearly all there to help them, many developers got a good tutorial or two in advanced coding especially on a team. Ryan on our team helped Kelly setup DesktopServer, and we both taught them how to use GIT for versioning, SASS and finally gulp for processing.</p>\n<p>&#8220;I even got a chance to bestow some AngularJS knowledge since the map and search results sidebar on the map were an AngularJS application powered by custom routes and endpoints of the WordPress REST API.&#8221;</p>\n<p>Sivan says he was astonished by the amount of people in the community that came together to volunteer their time and skills to help non-profit organizations and that he&#8217;s looking forward to attending the event again next year.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 25 Oct 2016 18:58:59 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:13;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:25:\"Matt: Common at Tiny Desk\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=46868\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"https://ma.tt/2016/10/common-at-tiny-desk/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:443:\"<p></p>\n<p>This <a href=\"http://www.npr.org/series/tiny-desk-concerts/\">Tiny Desk concert</a> at the <a href=\"http://www.npr.org/2016/10/03/496433228/common-tiny-desk-concert-at-the-white-house\">White House with Common</a> and some of my favorite musicians <a href=\"http://www.robertglasper.com/\">Robert Glasper</a>, <a href=\"http://music.derrickhodge.com/\">Derrick Hodge</a>, and <a href=\"http://bilalmusic.com/\">Bilal</a> was incredible.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 25 Oct 2016 14:28:04 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:14;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"WPTavern: WordPress 4.7 to Introduce User-Specific Language Setting for the Admin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=63054\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"https://wptavern.com/wordpress-4-7-to-introduce-user-specific-language-setting-for-the-admin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1948:\"<p>WordPress 4.7 will allow users to <a href=\"https://core.trac.wordpress.org/changeset/38705\" target=\"_blank\">select a language to use in the admin</a>. Prior to this change, using a different language for the admin required installing the necessary translations and editing the <em>wp-config.php</em> file or using a plugin.</p>\n<p>A user-specific language setting makes it possible to run a WordPress site in one language on the front end and administrate it in another without all of the previous hassle. For example, if a German newspaper site has contributors from all around the world, WordPress 4.7 makes it possible for each contributor to use the admin in his or her native language. The setting is available as a language dropdown on the user profile edit screen at <strong>wp-admin/profile.php</strong>.</p>\n<p><a href=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/10/admin-language-setting.png?ssl=1\"><img src=\"https://i0.wp.com/wptavern.com/wp-content/uploads/2016/10/admin-language-setting.png?resize=1025%2C325&ssl=1\" alt=\"admin-language-setting\" class=\"aligncenter size-full wp-image-63059\" /></a></p>\n<p>During my first test of the new feature I thought it was broken, but it turns out the setting is not visible if the site language is set to the default en_US. Change the site language under Settings to something else and WordPress will then show available translations in the user profile language dropdown.</p>\n<p>The user-specific language setting comes as a result of work on a two-year-old <a href=\"https://core.trac.wordpress.org/ticket/29783\" target=\"_blank\">ticket</a> and contributors&#8217; discussions at several European WordCamps during the past few years. It introduces a new <code>get_user_locale()</code> function that plugin developers will want to be aware of, especially those who have built other solutions that allow users to set a language for the admin.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 24 Oct 2016 21:22:03 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:15;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:103:\"WPTavern: LinkedIn Learning Is Offering Free Access This Week to Its Library of More Than 5,000 Courses\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=63072\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:113:\"https://wptavern.com/linkedin-learning-is-offering-free-access-this-week-to-its-library-of-more-than-5000-courses\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2104:\"<p><a href=\"https://www.lynda.com/\">Lynda.com</a>, a site that offers <a href=\"https://www.lynda.com/subject/all\">thousands of online training courses</a> is giving everyone an opportunity to access any course they want for free. Dubbed the &#8220;<a href=\"https://learning.linkedin.com/week-of-learning\">Week of Learning</a>&#8220;, starting today and ending on October 30th, visitors can take any course they want without any strings attached. The only thing that&#8217;s required is a LinkedIn account which is used to login to <a href=\"https://www.linkedin.com/learning/?trk=lilblog_src.li-other_c.WOL-announcement-10-21-16_brandspark_learning&cid=70132000001AyziAAC\">LinkedIn Learning</a>.</p>\n<p>Morten Rand-Hendriksen, an instructor for a <a href=\"https://www.linkedin.com/learning/instructors/725535\">number of courses</a> on Lynda.com, is excited about the event, &#8220;It gives everyone a chance to check out all the amazing content available on LinkedIn Learning and further their personal skills and professional careers,&#8221; Hendriksen said.</p>\n<p>To help newcomers decide which courses to take, Jillian Senechalle has compiled a list of the <a href=\"https://learning.linkedin.com/blog/whats-new/starting-this-monday--a-100--free-week-of-learning--for-the-firs\">10 most viewed courses</a> this year. Some of them include, <a href=\"https://www.linkedin.com/learning/excel-2013-essential-training?trk=lilblog_src.li-other_c.WOL-announcement-10-21-16_brandspark_learning&cid=70132000001AyziAAC\">Excel 2013 Essential Training</a>, <a href=\"https://www.linkedin.com/learning/communication-fundamentals?trk=lilblog_src.li-other_c.WOL-announcement-10-21-16_brandspark_learning&cid=70132000001AyziAAC\">Communication Fundamentals</a>, and <a href=\"https://www.linkedin.com/learning/javascript-essential-training?trk=lilblog_src.li-other_c.WOL-announcement-10-21-16_brandspark_learning&cid=70132000001AyziAAC\">JavaScript Essential Training</a>. If you&#8217;ve ever wanted to take a course on Lynda.com but didn&#8217;t have the funds, now is your chance.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 24 Oct 2016 21:18:10 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:16;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"WPTavern: Automattic Releases Free WordPress Stickers App for iOS 10\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=62709\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"https://wptavern.com/automattic-releases-free-wordpress-stickers-app-for-ios-10\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2713:\"<p><a href=\"http://www.apple.com/ios/ios-10/\" target=\"_blank\">iOS 10</a> was released last month with support for stickers in the the iMessage apps for iPhone and iPad. If you want to add a little WordPress flavor to your mobile communications, check out the new free <a href=\"https://itunes.apple.com/us/app/wordpress-world-stickers/id1139958755\" target=\"_blank\">WordPress World</a> iMessage sticker app from Automattic. The app includes some of the company&#8217;s mascots and logos, such as WooCommerce and Jetpack, as well as a collection of &#8220;sticker-ized&#8221; <a href=\"http://jawordpressorg.github.io/wapuu/\" target=\"_blank\">wapuus from the community</a>.</p>\n<a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/10/stickers-screens.png?ssl=1\"><img src=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/10/stickers-screens.png?resize=1025%2C910&ssl=1\" alt=\"image credit: WordPress.com\" class=\"size-full wp-image-63040\" /></a>image credit: <a href=\"https://en.blog.wordpress.com/2016/10/14/express-yourself-with-new-wordpress-stickers-for-ios-and-imessage/\">WordPress.com</a>\n<p>The sticker set is also being ported for use with Telegram, which has supported an <a href=\"https://telegram.org/blog/stickers-revolution\" target=\"_blank\">open sticker platform</a> since May 2015. <a href=\"https://twitter.com/astralbodies\" target=\"_blank\">Aaron Douglas</a>, an iOS mobile developer at Automattic, has added the stickers from the iOS app into a <a href=\"https://telegram.me/addstickers/WPWorld\" target=\"_blank\">WordPress World sticker pack for Telegram</a>.</p>\n<p><a href=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/10/stickers-telegram.png?ssl=1\"><img src=\"https://i2.wp.com/wptavern.com/wp-content/uploads/2016/10/stickers-telegram.png?resize=1025%2C1395&ssl=1\" alt=\"stickers-telegram\" class=\"aligncenter size-full wp-image-63074\" /></a></p>\n<p>&#8220;The process of porting is manual but doesn&#8217;t take a terrible amount of time,&#8221; Douglas said. &#8220;The only weird thing is Telegram associates an emoji with every sticker so finding an appropriate emoji for a particular sticker is tricky. Some people on Telegram just pick random emoji and they don&#8217;t care about the equivalence.&#8221;</p>\n<p>The Telegram sticker collection matches those in the iMessage sticker app after an update Douglas pushed this morning. Just a handful of the planned stickers are currently available, but users will automatically receive the new ones as the iOS app and Telegram pack are updated. Douglas said Automattic is planning to add more Wapuu created for the WordCamps and is looking into commissioning a few new ones for the app.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 24 Oct 2016 17:58:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:17;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"Post Status: WordPress REST API in Core — Draft podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=30103\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"https://poststatus.com/wordpress-rest-api-core-draft-podcast/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1964:\"<p>Welcome to the Post Status <a href=\"https://poststatus.com/category/draft\">Draft podcast</a>, which you can find <a href=\"https://itunes.apple.com/us/podcast/post-status-draft-wordpress/id976403008\">on iTunes</a>, <a href=\"https://play.google.com/music/m/Ih5egfxskgcec4qadr3f4zfpzzm?t=Post_Status__Draft_WordPress_Podcast\">Google Play</a>, <a href=\"http://www.stitcher.com/podcast/krogsgard/post-status-draft-wordpress-podcast\">Stitcher</a>, and <a href=\"http://simplecast.fm/podcasts/1061/rss\">via RSS</a> for your favorite podcatcher. Post Status Draft is hosted by Joe Hoyle &#8212; the CTO of Human Made &#8212; and Brian Krogsgard.</p>\n<p><span>In this episode, Joe and Brian talk about the WordPress REST API and the core approval process</span></p>\n<!--[if lt IE 9]><script>document.createElement(\'audio\');</script><![endif]-->\n<a href=\"https://audio.simplecast.com/50492.mp3\">https://audio.simplecast.com/50492.mp3</a>\n<p><a href=\"http://audio.simplecast.com/50492.mp3\">Direct Download</a></p>\n<h3>Topics</h3>\n<ul>\n<li>The API&#8217;s journey</li>\n<li>How Core projects work</li>\n<li>What to know about the API know that it&#8217;s in trunk</li>\n<li>What that means for the future of the API</li>\n</ul>\n<h3>Links</h3>\n<ul>\n<li><a href=\"https://apisyouwonthate.com/\">Build APIs you won&#8217;t hate</a></li>\n<li><a href=\"http://wp-api.org/index-deprecated.html\">Legacy v1 API</a></li>\n<li><a href=\"https://getmoxied.net/lean/\">LEAN</a></li>\n<li><a href=\"http://99percentinvisible.org/episode/mcmansion-hell-devil-details/\">McMansion Hell: The devil is in the details</a></li>\n</ul>\n<h3>Sponsor: OptinMonster</h3>\n<p><span><a href=\"http://optinmonster.com/the-new-google-mobile-friendly-rules-for-popups/\">OptinMonster</a> allows you to convert visitors into subscribers. You can easily create &amp; A/B test beautiful lead capture forms without a developer. Check out <a href=\"http://optinmonster.com/\">OptinMonster</a> today!</span></p>\n<p>&nbsp;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 24 Oct 2016 13:39:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Katie Richards\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:18;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Matt: Taking Sides\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=46861\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"https://ma.tt/2016/10/taking-sides/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:858:\"<p>From <a href=\"https://www.nobelprize.org/nobel_prizes/peace/laureates/1986/wiesel-acceptance_en.html\">Elie Wiesel&#8217;s Nobel Peace Price acceptance speech in 1986</a>:</p>\n<blockquote><p>And then I explained to him how naive we were, that the world did know and remain silent. And that is why I swore never to be silent whenever and wherever human beings endure suffering and humiliation. We must always take sides. Neutrality helps the oppressor, never the victim. Silence encourages the tormentor, never the tormented. Sometimes we must interfere. When human lives are endangered, when human dignity is in jeopardy, national borders and sensitivities become irrelevant. Wherever men or women are persecuted because of their race, religion, or political views, that place must – at that moment – become the center of the universe.</p></blockquote>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 22 Oct 2016 17:32:35 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:19;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"Matt: Defrauding an Election\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=46846\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:45:\"https://ma.tt/2016/10/defrauding-an-election/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1186:\"<p>Wired has a fun and informative look at <a href=\"https://www.wired.com/2016/10/wireds-totally-legit-guide-rigging-presidential-election/\">How to Rig a Presidential Election in 1000 Easy Steps</a>. Basically it&#8217;s impossible &#8212; I hadn&#8217;t really thought of this before, but every precinct has its own officials from both parties that certify everything, there are just a ton of people involved at every step of the process. All that said, I would love if voting platforms <a href=\"http://www.osetfoundation.org/\">were completely open source software and had paper receipts that could be verified manually</a>.</p>\n<p>Also speaking of politics getting dirty, the San Francisco State Senate race has had a ton of falsehoods and attacks from Scott Weiner, someone I&#8217;ve met before and previously thought was a nice guy, but <a href=\"http://48hills.org/2016/10/20/scott-wieners-deceitful-guardian-mailing/\">the latest mailers I&#8217;ve seen have just been deceitful</a> (especially considering the Guardian actually <a href=\"http://www.sfbg.com/2016/10/06/endorsements-the-case-for-six-progressive-supes-kim-for-state-senate/\">endorsed his opponent, Jane Kim</a>).</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 21 Oct 2016 23:12:50 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:20;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"WPTavern: Peter Meth Launches Kickstarter Campaign to Produce 7″ Wapuu Plush Toys\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=63019\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"https://wptavern.com/peter-meth-launches-kickstarter-campaign-to-produce-7-wapuu-plush-toys\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2894:\"<p><a href=\"https://ja.wordpress.org/about-wp-ja/wapuu/\">Wapuu</a> is the <a href=\"https://wptavern.com/community-translation-and-wapuu-how-japan-is-shaping-wordpress-history\">unofficial mascot</a> of the WordPress project and is quite the traveler appearing at WordCamps all over the world. While there is a <a href=\"https://mercantile.wordpress.org/\">variety of swag</a> featuring Wapuu, outside of handmade items, there isn&#8217;t a way to obtain a plush toy.</p>\n<a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/10/WapuuPlushToy.jpg?ssl=1\"><img class=\"size-full wp-image-63021\" src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/10/WapuuPlushToy.jpg?resize=700%2C770&ssl=1\" alt=\"Wapuu Plush Toy Prototype\" /></a>Wapuu Plush Toy Prototype\n<p>Peter Meth, a Senior PHP Consultant based in Toronto, Canada, is looking to change that with a <a href=\"https://www.kickstarter.com/projects/1035100786/plush-wapuu-collectible-unofficial-wordpress-masco\">crowdfunding campaign</a> using Kickstarter. Meth is seeking $11,338 to create a number of 7&#8243; Wapuu plush toys.</p>\n<p>&#8220;The factories that produce most of these items are in China and there are large minimum orders,&#8221; Meth said. &#8220;I have done the calculations and have tried to keep the Kickstarter goal at a minimum.&#8221;</p>\n<p>Meth has previous experience creating plush toys for other software projects. Last year, he <a href=\"https://www.kickstarter.com/projects/1035100786/truenorth-php-woolly-mammoth-plush-toy\">successfully raised $35K</a> from 432 backers to create a PHP Woolly Mammoth plush toy. While the web version of Wapuu features the WordPress logo, the plush toy does not.</p>\n<p>&#8220;The WordPress logo is a trademark of the WordPress Foundation,&#8221; Meth said. &#8220;I did not get permission to use their logo. I am in no way affiliated with WordPress. This product is a plush toy, not software and on his chest is just a regular W with a circle around it.&#8221;</p>\n<p>If successfully funded, backers won&#8217;t receive the product for at least a few months as the orders are created, processed, and shipped from China to Canada. Meth will then package the orders and ship them to backers, &#8220;I have done it before and have figured out the best ways to get these items to backers quickly and efficiently,&#8221; he said.</p>\n<p>Pledges range from purchasing one plush toy up to five. There&#8217;s also a pledge available for about $763 where companies can have their advertising materials shipped with each toy.</p>\n<p>So far, Meth has raised <a href=\"https://www.kickstarter.com/projects/1035100786/plush-wapuu-collectible-unofficial-wordpress-masco\">$676 from 20 backers</a> with 29 days left to go. Considering the lack of Wapuu plush toys in existence, these would be excellent collectibles to give away at WordCamps.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 21 Oct 2016 20:22:13 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:21;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"WPTavern: WordCamp Orlando Rescheduled for November 12-13\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=63014\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"https://wptavern.com/wordcamp-orlando-rescheduled-for-november-12-13\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1336:\"<p>WordCamp Orlando which was originally scheduled for October 9-10 will now take place the weekend of<a href=\"https://2016.orlando.wordcamp.org/2016/10/12/wordcamp-orlando-2016-is-rescheduled/\"> November 12-13</a>. The event <a href=\"https://2016.orlando.wordcamp.org/2016/10/05/wordcamp-orlando-canceled-due-to-hurricane-matthew/\">was cancelled</a> after the venue was ordered closed due to Hurricane Matthew.</p>\n<p>The event is being held at the UCF Rosen Campus and features a different schedule than the October event. Saturday will have a networking brunch, keynote session, and three tracks of hour-long sessions. The Developer&#8217;s and WordPress for Beginners workshops will be held on Sunday along with a track of sessions dedicated to business and marketing.</p>\n<p>Lisa Melegari, lead organizer for WordCamp Orlando, says the team was unable to re-negotiate a discounted rate for hotel rooms with Rosen Shingle Creek. If your reservation was cancelled due to the storm, she suggests contacting the hotel directly and try booking the room at the same rate.</p>\n<p>Extra tickets will go on sale once sessions are decided and speakers are confirmed. Those who purchased tickets for the October event and did not request a refund are able to use the same ticket to attend in November.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 21 Oct 2016 19:24:39 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:22;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"WPTavern: LoopConf Rescheduled for February 6-8, 2017, in Salt Lake City, Utah\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=63008\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"https://wptavern.com/loopconf-rescheduled-for-february-6-8-2017-in-salt-lake-city-utah\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2433:\"<p><a href=\"https://loopconf.com/\">LoopConf</a>, a conference geared towards WordPress developers has been rescheduled for February 6-8, 2017, and will be held in Salt Lake City, Utah. The event was originally scheduled to take place in Florida but <a href=\"https://wptavern.com/loopconf-postponed-due-to-hurricane-matthew-wordcamp-orlando-is-questionable\">was cancelled</a> due to Hurricane Matthew.</p>\n<p>Ryan Sullivan, lead organizer of the event who lives in Salt Lake City, says one of the reasons he chose his hometown is to take advantage of local connections.</p>\n<p>&#8220;When we chose to reschedule LoopConf, there was a very large financial impact attached to that,&#8221; Sullivan said.</p>\n<p>&#8220;Had we chosen another resort destination, our money would have been committed to the logistics and venue there, and we would have had to scale back on attendee experience.</p>\n<p>&#8220;That wasn’t something we were willing to sacrifice, so we brought the event back home so we could lean on some local connections, and still put on a fantastic event without asking anything else of the attendees or sponsors.&#8221;</p>\n<p>Tickets that were purchased for the Florida event are automatically being transferred to the Salt Lake City event. Those who can&#8217;t make it and would like to request a refund need to send an email to info @ loopconf.com and add Refund Request to the subject line. Refund requests should be submitted before October 31st.</p>\n<p>Those who couldn&#8217;t attend the event in October but can in February are in luck as <a href=\"https://ti.to/loopconf/loopconf-2016\">tickets are back on sale</a> to the public, &#8220;We’re hoping to bolster and regain some of what we’ve lost, and we know that won’t be possible without the support of the WordPress community at large,&#8221; Sullivan said.</p>\n<p>Sullivan has also negotiated a deal with the <a href=\"http://saltlake.littleamerica.com/\">Little America</a> hotel located a few blocks from the venue. Room rates are $179 per night instead of the usual $229 and ground transportation will be provided each day to and from the venue. While rooms are not currently available for reservation at the lower price, Sullivan says a special link will be published soon.</p>\n<p>For detailed information on the event and to purchase tickets, visit the <a href=\"https://loopconf.com/\">LoopConf</a> website.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 21 Oct 2016 18:26:03 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:23;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:106:\"WPTavern: BuddyPress 2.7 Released, Features Groups Query Overhaul and Improvements for Site Administrators\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=62866\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:116:\"https://wptavern.com/buddypress-2-7-released-features-groups-query-overhaul-and-improvements-for-site-administrators\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4016:\"<a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/10/samsbrooklyn.jpg?ssl=1\"><img src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/10/samsbrooklyn.jpg?resize=886%2C487&ssl=1\" alt=\"photo credit: Eater NY\" class=\"size-full wp-image-62882\" /></a>photo credit: <a href=\"http://ny.eater.com/2010/11/12/6710425/leave-the-attitude-at-the-door-at-sams-restaurant\">Eater NY</a>\n<p><a href=\"https://buddypress.org/2016/10/buddypress-2-7-0-migliaccio/\" target=\"_blank\">BuddyPress 2.7</a> &#8220;Migliaccio&#8221; was released yesterday, named after the family who runs Sam’s Restaurant in Brooklyn. The sign in front of the establishment features steaks and chops, but the restaurant&#8217;s pizza is &#8220;one of the great under-appreciated pies in all of NYC,&#8221; according to BuddyPress core developers.</p>\n<p>This release is heavy on features for developers, in line with the project&#8217;s <a href=\"https://wptavern.com/buddypress-2-7-development-kicks-off-project-shifts-focus-to-developers-and-site-builders\" target=\"_blank\">recent change of course</a>. The BuddyPress core team is now focusing on the experience of developers and site builders, as opposed to providing something that is 100% turnkey.</p>\n<p>Version 2.7 delivers significant performance improvements to sites that are using the Groups component. <a href=\"https://bpdevel.wordpress.com/2016/09/19/group-queries-have-been-rewritten-for-bp-2-7/\" target=\"_blank\">Group queries have been completely re-written</a> to be less memory-intensive by following WordPress&#8217; move to use the &#8220;split&#8221; model for object queries.</p>\n<p>&#8220;The changes we’ve made for BP 2.7 should lead to a huge performance improvement on sites using persistent caching,&#8221; BuddyPress lead developer Boone Gorges said. &#8220;When querying groups, not only are group objects now fetched from the cache when available, but the ID queries themselves are cached as well.&#8221;</p>\n<p>Version 2.7 is rather lean on user-facing features but one helpful addition is a new email token that makes it possible for users to <a href=\"https://buddypress.trac.wordpress.org/ticket/6932\" target=\"_blank\">unsubscribe from BuddyPress-generated emails</a>. The unsubscribe links have been added to the emails that are listed on the email settings page.</p>\n<p>This release also introduces many improvements for site administrators, which will make BuddyPress easier to manage and customize:</p>\n<ul>\n<li><strong>Use WP Page Names for Headings of BP Directory Pages</strong><br />\nWhatever you choose as the title of your Activity, Sites, Members, or Groups directory pages on the back end, is what you’ll get as the heading on the front end.</li>\n<li><strong>Use the Site Icon as Your Site’s Profile Photo</strong><br />\nBuddyPress sets the site admin’s profile photo as the default site profile photo on the Sites Directory page. You can now use the <a href=\"https://codex.wordpress.org/Creating_a_Favicon#WordPress_Version_4.3_or_later\" target=\"_blank\">Site Icon introduced in WordPress 4.3</a> instead.</li>\n<li><strong>Member Type and Group Type Filters in Users and Groups Admin Screens</strong><br />\nEasily filter your members and groups by type and set types in bulk on the users and groups list tables in the dashboard.</li>\n<li><strong>Improved Profile Date Field</strong><br />\nNew Date Field settings, “Date format” and “Range”, make it easier for site administrators to decide how date-based data will be collected and displayed.</li>\n</ul>\n<p>This is the first release since the project&#8217;s new developer-oriented direction was announced. The improvements shipped in 2.7 reflect the core development team&#8217;s commitment to better serve those who are developing and managing BuddyPress sites. For a list of all the changes and links to documentation, check out the full <a href=\"https://codex.buddypress.org/releases/version-2-7-0/\" target=\"_blank\">2.7 changelog</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 21 Oct 2016 04:16:24 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:24;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"WPTavern: New WordPress Default Theme Twenty Seventeen Merged into 4.7\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=62839\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"https://wptavern.com/new-wordpress-default-theme-twenty-seventeen-merged-into-4-7\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3781:\"<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/10/twenty-seventeen-1024x597.png?ssl=1\"><img src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/10/twenty-seventeen-1024x597.png?resize=1024%2C597&ssl=1\" alt=\"twenty-seventeen-1024x597\" class=\"aligncenter size-full wp-image-62970\" /></a></p>\n<p>WordPress 4.7 will ship with a new default theme in December. David Kennedy <a href=\"https://core.trac.wordpress.org/changeset/38833/\" target=\"_blank\">merged Twenty Seventeen into core</a> yesterday as his first commit to WordPress. Any remaining development issues for the project will now be managed via Trac.</p>\n<p>In the <a href=\"https://make.wordpress.org/core/2016/10/18/twenty-seventeen-merge-proposal-for-4-7/\" target=\"_blank\">merge proposal</a>, Kennedy described Twenty Seventeen as &#8220;an ambitious theme that focuses on a creative home page and an easy site setup experience for users.&#8221; It is the first default theme designed specifically for business websites. The theme includes four customizable panels on the front page (as seen in Kennedy&#8217;s demo video below), which can be set to display content from existing pages. It includes support for uploading a custom logo and uses SVG icons throughout the theme, which Kennedy notes is a first for a default theme.</p>\n<div class=\"wp-video\"><!--[if lt IE 9]><script>document.createElement(\'video\');</script><![endif]--><br />\n<a href=\"https://make.wordpress.org/core/files/2016/10/panels-ui-small.mp4\">https://make.wordpress.org/core/files/2016/10/panels-ui-small.mp4</a></div>\n<p>Twenty Seventeen will offer three different options for a color scheme: light, dark, or custom (which can be set via a user-friendly color-picker):</p>\n<div class=\"wp-video\"><a href=\"https://make.wordpress.org/core/files/2016/10/colors.mp4\">https://make.wordpress.org/core/files/2016/10/colors.mp4</a></div>\n<p>&#8220;Twenty Seventeen will ship with its current implementation of panels in the theme and without video headers,&#8221; Kennedy said during yesterday&#8217;s core development meeting. A <a href=\"https://core.trac.wordpress.org/ticket/38172\" target=\"_blank\">ticket for adding core support for video headers</a> is open on Trac and contributors are still working out all of the intricacies of the feature. It may not be ready to ship with the first version of Twenty Seventeen, but it&#8217;s an exciting step forward for standardizing an approach for developers who want to build video headers into their themes.</p>\n<p>&#8220;Video headers are definitely doable,&#8221; Nick Halsey said during yesterday&#8217;s meeting. &#8220;It&#8217;s a matter of getting consensus on the best approach on the ticket.&#8221;</p>\n<p>Contributors have also <a href=\"https://core.trac.wordpress.org/ticket/37974\" target=\"_blank\">discussed creating a multi-panel page</a> that lets users select content for the different sections. It would benefit Twenty Seventeen but contributors are considering giving it more time in development as a feature plugin.</p>\n<p>&#8220;Regarding multi-panel, I’d agree that it’s not going to make it,&#8221; Kennedy said in the #core Slack channel today. &#8220;That isn’t to diminish the awesome work done so far, but it needs more. I’d like to start making plans for it to be a feature plugin, perhaps. I want to see the momentum continue. Core needs a solution around this, and it will take more people to help make it even better.&#8221;</p>\n<p>Twenty Seventeen has had 59 contributors to date and may gain a few more before the 4.7 release cycle is finished. The theme will benefit from testing in as many different environments as possible, since it will immediately be high profile as the next default WordPress theme.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 20 Oct 2016 18:19:17 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:25;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:38:\"WPTavern: WordCamp WarmUp Is a Success\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=62874\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"https://wptavern.com/wordcamp-warmup-is-a-success\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2384:\"<p>Rebecca Gill, founder of <a href=\"https://www.web-savvy-marketing.com/\">Web-Savvy-Marketing</a>, has published a postmortem of <a href=\"https://2016.annarbor.wordcamp.org/wordcamp-warmup/\">WordCamp WarmUp</a>, an event that took place two days before WordCamp Ann Arbor aimed at breaking the ice for new WordCamp attendees. The event surpassed its goal of 50 attendees forcing Gill to close registration early.</p>\n<p>&#8220;Not only did most WarmUp guests arrive right on time, we had a full room of WarmUp attendees and even had a few unexpected friends show up,&#8221; Gill said.</p>\n<p>Gill created three different lists that included interesting things about attendees, their interests, and their talents. She then created packets that attendees could use to seek out specific people, &#8220;I’m not sure how many people used my lists, but I will say most people took packets with them when they left the event,&#8221; Gill said.</p>\n<p>She challenged attendees to meet at least 20 people during WordCamp Ann Arbor. While a handful of people completed the challenge, its purpose was to provide an additional incentive.</p>\n<p>&#8220;I really don’t care how many people an individual met,&#8221; Gill said. &#8220;My goal was to get them to meet more than they would without WarmUp and to encourage them to get to know others if their personalities allowed.&#8221;</p>\n<p>Gill conducted a poll shortly after the event to gather feedback and received 15 responses. When asked how the event made their WordCamp experience more meaningful, a number of people offered positive feedback:</p>\n<ul>\n<li>It was nice to come on Friday and already recognize some people</li>\n<li>I was able to connect with other WordCamp goers, which made the following days more exciting. It helped me orient myself mentally to think ahead about what I wanted to learn and what I wanted to get out of the event as a whole.</li>\n<li>I met some people! So then there were familiar faces at the actual WordCamp.</li>\n<li>The event was a great ice breaker to WordCamp.</li>\n</ul>\n<p>To read all of the feedback and view photos of the event, check out the <a href=\"https://www.web-savvy-marketing.com/2016/10/recap-of-wordcamp-ann-arbors-wordcamp-warmup/\">wrapup post</a>. If you attended WordCamp Warmup, tell us about your experience in the comments.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 19 Oct 2016 21:12:09 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:26;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:88:\"WPTavern: WP REST API Content Endpoints Officially Approved for Merge into WordPress 4.7\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=62877\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"https://wptavern.com/wp-rest-api-officially-approved-for-merge-into-wordpress-4-7\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2640:\"<p><a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/wp-rest-api.jpg?ssl=1\"><img src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/wp-rest-api.jpg?resize=1025%2C469&ssl=1\" alt=\"wp-rest-api\" class=\"aligncenter size-full wp-image-43000\" /></a></p>\n<p>After a lengthy and impassioned meeting in the WordPress #core Slack channel on Monday evening, the WP REST API content endpoints were <a href=\"https://wptavern.com/wp-rest-api-content-endpoints-conditionally-approved-for-merge-in-4-7\" target=\"_blank\">conditionally approved for merge into 4.7</a>. Since that time Brian Krogsgard published a <a href=\"https://make.wordpress.org/core/2016/10/19/wordpress-rest-api-success-metrics/\" target=\"_blank\">document</a> with input from the team on how they plan to measure the success of the API.</p>\n<p>The conditions included some last minute work from the team on demonstrating how the API can benefit core development. Contributors produced multiple proofs of concept, including <a href=\"https://core.trac.wordpress.org/ticket/38343\" target=\"_blank\">leveraging the REST API endpoints for Press this</a> and <a href=\"https://core.trac.wordpress.org/ticket/38342\" target=\"_blank\">Quick Draft</a> features.</p>\n<p>&#8220;I think the team has come together really well over the last couple days to tackle the merge tasks,&#8221; WordPress core committer Jeremy Felt said. &#8220;It seems that the momentum is on the right track to merge and then continue knocking out issues throughout the rest of the cycle as we start testing it as part of core. I’m also pretty excited about the pieces of the admin that are about to start using it with such a short window. 4.8 and 4.9 have a ton of potential with the API.&#8221;</p>\n<p>Contributors in attendance at today&#8217;s core development meeting agreed that the team had made significant strides to meet the conditions previously identified for merge. After a short few minutes of discussion, WordPress 4.7 release lead Helen Hou-Sandí officially approved the WP REST API content endpoints for merge into core.</p>\n<p><a href=\"http://github.com/WP-API/WP-API\" target=\"_blank\">Code on the GitHub</a> repository will now be frozen and continued development will be managed via WordPress trac. The WP REST API has had 99 contributors on the project to date. The content endpoints identified in the <a href=\"https://make.wordpress.org/core/2016/10/08/rest-api-merge-proposal-part-2-content-api/\" target=\"_blank\">merge proposal</a> will ship with WordPress 4.7 and contributors will focus on authentication for the 4.8 release cycle.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 19 Oct 2016 21:10:08 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:27;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"WPTavern: WordPress 4.7 to Ship with Infrastructure from the Customize Snapshots Feature Plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://wptavern.com/?p=62835\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:106:\"https://wptavern.com/wordpress-4-7-to-ship-with-infrastructure-from-the-customize-snapshots-feature-plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3965:\"<a href=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/03/snapshots.jpg?ssl=1\"><img src=\"https://i1.wp.com/wptavern.com/wp-content/uploads/2016/03/snapshots.jpg?resize=750%2C446&ssl=1\" alt=\"photo credit: Chantel Lucas\" class=\"size-full wp-image-52875\" /></a>photo credit: <a href=\"https://stocksnap.io/photo/410Y7ES74I\">Chantel Lucas</a>\n<p>Customize Changesets, the technical term for the infrastructure in the <a href=\"https://wordpress.org/plugins/customize-snapshots/\" target=\"_blank\">Customize Snapshots</a> feature plugin, was <a href=\"https://core.trac.wordpress.org/changeset/38810\" target=\"_blank\">merged into WordPress 4.7</a> yesterday. The project, formerly known as <a href=\"https://make.wordpress.org/core/2015/01/26/customizer-transactions-proposal/\" target=\"_blank\">Customizer Transactions</a>, brings the underlying architecture required for the ability to save a session as a draft. It enables WordPress to save a set of changes made in the Customizer so that it can be shared, previewed outside of the iframe, and even published at a future date.</p>\n<p>Although the initial introduction of Customize Changesets will ship with no UI, it is the gateway for a host of exciting new features in the Customizer.</p>\n<p>&#8220;The new APIs make possible many new user-facing features in future releases and feature plugins, including saving long-lived drafts, submitting changesets as pending for review, scheduling changes, seeing the previewed state on the frontend without being in an iframe, sharing preview URLs with others who do not have customizer access, and others,&#8221; project lead Weston Ruter said in the <a href=\"https://make.wordpress.org/core/2016/10/12/customize-changesets-formerly-transactions-merge-proposal/\" target=\"_blank\">merge proposal</a>.</p>\n<p>Users will be able to detect the Customize Changesets architecture in WordPress in two ways. A new customize_uuid query parameter is added onto the URL. Also, users can now reload pages in the Customizer and the changes that have already been made will persist.</p>\n<p>&#8220;In future releases we can explore new UIs to take advantage of the new capabilities that changesets provide,&#8221; Ruter said. &#8220;New UIs can provide a way to schedule changes, the ability to undo the last change, show an audit log (revision history) for changes, collaborative editing of a customizer changeset, and so on. Future feature projects will explore many of these and feature plugins will start to prototype them.&#8221;</p>\n<p>Ruter also noted that Customize changesets fixes &#8220;several long-standing issues related to incompatibilities between JavaScript running on the site’s frontend when previewed in the customizer.&#8221; This should make the experience of customizing WordPress less buggy for users.</p>\n<p>When I asked Ruter if the UI for core will come from the Customize Snapshots feature plugin, he said he&#8217;s not certain whether the team will migrate the features into a separate “Customize Changesets UI” plugin or adapt it to make use of changesets instead.</p>\n<p>&#8220;Either way, the UI features will live on and will be prototyped in feature plugin form before proposal for core merge,&#8221; Ruter said. &#8220;The underlying plumbing from Snapshots was adapted for changesets now in core. So the snapshots itself needs its internals to be gutted to re-use changesets.&#8221;</p>\n<p>From there contributors will begin <a href=\"https://core.trac.wordpress.org/ticket/31089#comment:11\" target=\"_blank\">building a UI for managing changesets</a>, which includes listing existing changesets and their revisions, as well as moving a changeset post from auto-draft to draft, pending, or future. Ruter encourages those who want to contribute to a changesets UI for core to get involved in the <a href=\"https://github.com/xwp/wp-customize-snapshots\" target=\"_blank\">Customize Snapshots plugin on GitHub</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 19 Oct 2016 19:25:56 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:28;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"BuddyPress: BuddyPress 2.7.0 – “Migliaccio”\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://buddypress.org/?p=260004\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"https://buddypress.org/2016/10/buddypress-2-7-0-migliaccio/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:9299:\"<p>BuddyPress 2.7 “Migliaccio” is now available for download from the WordPress.org plugin repository, or right from your WordPress Dashboard. “Migliaccio” focuses on new features for developers and site builders.</p>\n<p><strong><span class=\"dashicons dashicons-list-view\"></span> Groups Query Overhaul</strong><br />\nHuge performance improvements on sites using persistent caching. Learn more about the Groups Query rewrite.</p>\n<p><strong><span class=\"dashicons dashicons-calendar\"></span> Improved Profile Date Field</strong><br />\nNew Date Field settings, &#8220;Date format&#8221; and &#8220;Range&#8221;, make it easier for site administrators to decide how date-based data will be collected and displayed.</p>\n<p><strong><span class=\"dashicons dashicons-groups\"></span> Group Types Integration in Templates</strong><br />\nEnable developers to show Group Types on the front end as well as control where the group type information is rendered. Learn how to implement this feature.</p>\n<p><strong><span class=\"dashicons dashicons-admin-multisite\"></span> Use the Site Icon as Your Site’s Profile Photo</strong><br />\nBuddyPress sets the site admin’s profile photo as the default site profile photo on the Sites Directory page. You can now use the Site Icon introduced in WordPress 4.3 instead.</p>\n<p><strong><span class=\"dashicons dashicons-filter\"></span> Member Type and Group Type Filters in Users and Groups Admin Screens</strong><br />\nEasily filter your members and groups by type and set types in bulk on the users and groups list tables in the dashboard.</p>\n<p><strong><span class=\"dashicons dashicons-clock\"></span> Localized Timestamps</strong><br />\nFix inaccurate timestamps due to time zones or page caching with new client-side timestamp handling.</p>\n<p><strong><span class=\"dashicons dashicons-email\"></span> Links to Unsubscribe from Emails</strong><br />\nImprove user experience by facilitating the removal of any or all subscriptions via new email tokens and unsubscribe links.</p>\n<p><strong><span class=\"dashicons dashicons-admin-page\"></span> Use WP Page Names for Headings of BP Directory Pages</strong><br />\nWhatever you choose as the title of your Activity, Sites, Members, or Groups directory pages on the back end, is what you’ll get as the heading on the front end.</p>\n<p><strong><span class=\"dashicons dashicons-universal-access\"></span> Accessibility Updates for the Front End and Back End</strong><br />\nContinued improvements for universal access help make BuddyPress back- and front-end screens usable for everyone (and on more devices).</p>\n<p><strong><span class=\"dashicons dashicons-screenoptions\"></span> Refactored <strong>BP_Button</strong> Class to Accept New Arguments</strong><br />\nProvides developers with improved syntax and more control over the rendering of buttons.</p>\n<p><strong><span class=\"dashicons dashicons-image-filter\"></span> Improvements to a Single Group’s Management Screens</strong><br />\nImproved markup, new modular group management templates, and a new member search form are just some of the enhancements added to the single group admin screens.</p>\n<p><strong><span class=\"dashicons  dashicons-groups\"></span> Support for Querying for Groups by New Column <code>parent_id</code></strong><br />\nQuery support for hierarchical groups makes it much easier for developers to add custom front-end functionality.</p>\n<p><strong><span class=\"dashicons dashicons-chart-bar\"></span> Many, Many Performance Improvements</strong><br />\nImproved performance by removing extra database queries, adding new cache calls, and removing the number of loops in <code>bp_get_user_groups()</code>.</p>\n<p><strong>…and much more!</strong><br />\nRead about all the bug fixes and feature enhancements introduced in BuddyPress 2.7.0 at our <a href=\"https://codex.buddypress.org/releases/version-2-7-0/\">official 2.7.0 changelog</a>.</p>\n<p><strong>Thank You to Our Contributors</strong><br />\nMany, many thanks to all those who contributed during this development cycle. This is a volunteer-run project, and these contributors freely gave of their time and expertise to make BuddyPress better than ever:<br />\n<a href=\"https://profiles.wordpress.org/jorbin/\">Aaron Jorbin (jorbin)</a>, <a href=\"https://profiles.wordpress.org/abwebstudio1/\">abwebstudio1</a>, <a href=\"https://profiles.wordpress.org/boonebgorges/\">Boone B Gorges (boonebgorges)</a>, <a href=\"https://profiles.wordpress.org/sbrajesh/\">Brajesh Singh (sbrajesh)</a>, <a href=\"https://profiles.wordpress.org/needle/\">Christian Wach (needle)</a>, <a href=\"https://profiles.wordpress.org/danbp/\">danbp</a>, <a href=\"https://profiles.wordpress.org/danielhuesken/\">Daniel Hüsken (danielhuesken)</a>, <a href=\"https://profiles.wordpress.org/dcavins/\">David Cavins (dcavins)</a>, <a href=\"https://profiles.wordpress.org/demon_ru/\">demon_ru</a>, <a href=\"https://profiles.wordpress.org/wpdennis/\">Dennis (wpdennis)</a>, <a href=\"https://profiles.wordpress.org/ericlewis/\">Eric Andrew Lewis (ericlewis)</a>, <a href=\"https://profiles.wordpress.org/henrywright/\">Henry Wright (henry.wright)</a>, <a href=\"https://profiles.wordpress.org/herbovec/\">herbovec</a>, <a href=\"https://profiles.wordpress.org/hnla/\">Hugo (hnla)</a>, <a href=\"https://profiles.wordpress.org/jdgrimes/\">J.D. Grimes (jdgrimes)</a>, <a href=\"https://profiles.wordpress.org/johnjamesjacoby/\">John James Jacoby (johnjamesjacoby)</a>, <a href=\"https://profiles.wordpress.org/dunhakdis/\">Joseph G. (dunhakdis)</a>, <a href=\"https://profiles.wordpress.org/kitsunesolar/\">kitsunesolar</a>, <a href=\"https://profiles.wordpress.org/lakrisgubben/\">lakrisgubben</a>, <a href=\"https://profiles.wordpress.org/Offereins\">Laurens Offereins (Offereins)</a>, <a href=\"https://profiles.wordpress.org/imath/\">Mathieu Viet (imath)</a>, <a href=\"https://profiles.wordpress.org/mercime/\">mercime</a>, <a href=\"https://profiles.wordpress.org/tw2113/\">Michael Beckwith (tw2113)</a>, <a href=\"https://profiles.wordpress.org/michaelbeil/\">Michael Beil (michaelbeil)</a>, <a href=\"https://profiles.wordpress.org/swissspidy/\">Pascal Birchler (swissspidy)</a>, <a href=\"https://profiles.wordpress.org/DJPaul/\">Paul Gibbs (DJPaul)</a>, <a href=\"https://profiles.wordpress.org/r-a-y/\">r-a-y</a>, <a href=\"https://profiles.wordpress.org/espellcaste/\">Renato Alves (espellcaste)</a>, <a href=\"https://profiles.wordpress.org/scharc/\">scharc</a>, <a href=\"https://profiles.wordpress.org/slaffik/\">Slava Abakumov (slaffik)</a>, <a href=\"https://profiles.wordpress.org/spenser4551/\">spenser4551</a>, <a href=\"https://profiles.wordpress.org/netweb/\">Stephen Edgar (netweb)</a>, <a href=\"https://profiles.wordpress.org/svenl77/\">Sven Lehnert (svenl77)</a>, <a href=\"https://profiles.wordpress.org/tharsheblows/\">tharsheblows</a>, <a href=\"https://profiles.wordpress.org/thomaslhotta/\">thomaslhotta</a>, <a href=\"https://profiles.wordpress.org/tomas711/\">tomas711</a>, <a href=\"https://profiles.wordpress.org/venturavan2/\">venturavan2</a>, and <a href=\"https://profiles.wordpress.org/wordpressrene/\">wordpressrene</a>.</p>\n<p><strong>Thank You BuddyPress Translators!</strong><br />\nThank you to all of our multilingual friends who make BuddyPress available in a bouquet of languages. The following generous volunteers have 95% complete translations (or better!) of BuddyPress in your language:<br />\n<a href=\"https://profiles.wordpress.org/baardkr/\">baardkr</a> (nb_NO), <a href=\"https://profiles.wordpress.org/casiepa/\">casiepa</a> (it_IT), <a href=\"https://profiles.wordpress.org/danbp/\">danbp</a> (fr_FR), <a href=\"https://profiles.wordpress.org/dancaragea/\">dancaragea</a> (ro_RO), <a href=\"https://profiles.wordpress.org/espellcaste/\">espellcaste</a> (pt_BR), kidsguide (en_CA), <a href=\"https://profiles.wordpress.org/netweb/\">netweb</a> (en_AU), <a href=\"https://profiles.wordpress.org/slaffik/\">slaffik</a> (ru_RU), <a href=\"https://profiles.wordpress.org/trkr/\">trkr</a> (tr_TR), <a href=\"https://profiles.wordpress.org/vanespenamaury/\">vanespenamaury</a> (fr_FR), <a href=\"https://profiles.wordpress.org/webaware/\">webaware</a> (en_NZ)</p>\n<p>Many more are nearly complete. <a href=\"https://buddypress.org/support/topic/buddypress-translation-editors-contributors/\">We could use your help</a>!</p>\n<h2>Meet you at Sam&#8217;s</h2>\n<p>We&#8217;ve called BuddyPress 2.7 &#8220;Migliaccio&#8221;, in honor of the family that runs Sam&#8217;s Restaurant in Brooklyn. Don&#8217;t be fooled by the &#8220;Steaks&#8221; and &#8220;Chops&#8221; signs out front: the Italian food here is great, but the pizza stands apart as one of the great underappreciated pies in all of NYC. As a bonus, careful observers just might spot hanging in Sam&#8217;s a photo of a certain BuddyPress developer, taken on the day he became a father. It&#8217;s a real family joint!</p>\n<h2>Time to Go Get 2.7.0!</h2>\n<p>Download BuddyPress 2.7 &#8220;Magliaccio&#8221; from the <a href=\"https://wordpress.org/plugins/buddypress/\">wordpress.org plugin repository</a>, or install/upgrade right from your WordPress Dashboard. </p>\n<p><strong>Questions, comments, feature requests, or bug reports</strong>? Please use our <a href=\"https://buddypress.org/support/\">support forums</a> or our <a href=\"https://buddypress.trac.wordpress.org/\">development tracker</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 19 Oct 2016 19:16:57 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"@mercime\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:29;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"HeroPress: WordPress Set Me Free\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"http://heropress.com/?post_type=heropress-essays&p=1415\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"http://heropress.com/essays/wordpress-set-free/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:13485:\"<img width=\"960\" height=\"480\" src=\"http://20094-presscdn.pagely.netdna-cdn.com/wp-content/uploads/2017/10/101816-1024x512.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Pull Quote: I\'m now a believer that WordPress can scale on large projects.\" /><p>I’m Carl Alberto, a work-from-home WordPress web developer based in Antipolo, Philippines. I hope my story will inspire people that came from schools that don’t teach too much technical stuff and people that are coming from remote or not highly developed places It won’t be a hindrance in getting a good WordPress related job.</p>\n<h3>Web Development in my early years</h3>\n<p>I had a first glimpse about web development around the mid 90’s when my dad was able to manage in buying an IBM-clone 4&#215;86 for me. It was marquees and frameset were the cool stuffs back then. During our college, not too much is being taught in our school and Internet is slow and very limited so I have to learn on my own and mostly at home. It’s amazing to imagine that we were able to survive with a 56kps dial-up connection way back then.</p>\n<blockquote class=\"instagram-media\"><div>\n<div>\n<div></div>\n</div>\n<p> <a href=\"https://www.instagram.com/p/BLa-YgTgtqp/\" target=\"_blank\">my first computer circa 90s #oldpic</a></p>\n<p>A photo posted by Carl Alberto (@carl.alberto) on Oct 11, 2016 at 4:46am PDT</p>\n</div>\n</blockquote>\n<p></p>\n<p>I was able to get a lot of practice in programming because my other batchmates were too lazy to do their school projects. They easily give up, rant a lot about the school’s broken facilities and would rather play Warcraft DOTA or Counter Strike while I am busy doing thesis projects. At that time, I was into electronics and was using other CMSes for web based projects because I had the impression that WordPress is just a blogging platform and not as powerful as the others.</p>\n<blockquote class=\"instagram-media\"><div>\n<div>\n<div></div>\n</div>\n<p> <a href=\"https://www.instagram.com/p/BLc6P9LglLd/\" target=\"_blank\">Worth the effort, sleepless nights of research and programming #collegedays #oldpic</a></p>\n<p>A photo posted by Carl Alberto (@carl.alberto) on Oct 11, 2016 at 10:49pm PDT</p>\n</div>\n</blockquote>\n<p></p>\n<h3>Entering The Corporate Office Scene While Undergraduate</h3>\n<p>Unfortunately, due to financial issues, I have to work on my own to finish up my last few years of studies but it did not became a hindrance for me in getting my degree. The fastest way to get a job here without any diploma and experience is through contact centers. I am very thankful to this industry because many filipinos got a decent living out of it specially for those people that came from the provinces.</p>\n<blockquote class=\"instagram-media\"><div>\n<div>\n<div></div>\n</div>\n<p> <a href=\"https://www.instagram.com/p/BLcNZirA69o/\" target=\"_blank\">Tech Support days at Epson &#8211; Teleperformance</a></p>\n<p>A photo posted by Carl Alberto (@carl.alberto) on Oct 11, 2016 at 4:17pm PDT</p>\n</div>\n</blockquote>\n<p></p>\n<p>After a year of struggle with the traffic and balancing my life with school and work, finally I got my diploma. I tried to pursue an office based tech related career but most of the job openings needs at least 1 years experience and based in Makati, which is 2 hours away from me. I was able to land an office based job but I gave up in less than 6 months because of the huge amount of time and effort that I loose during the commute. Imagine, an average filipino loses 4 hours of time during the travel. In a month, it translates to at least 80 hours of wasted time. Multiply that to the millions of the office workers that travels everyday.</p>\n<blockquote class=\"instagram-media\"><div>\n<div>\n<div></div>\n</div>\n<p> <a href=\"https://www.instagram.com/p/BLdCy4Ig-W9/\" target=\"_blank\">View of #metromanila from #antipolo it looks near but traffic will kill your time  #drone #aerialphotography</a></p>\n<p>A photo posted by Carl Alberto (@carl.alberto) on Oct 12, 2016 at 12:03am PDT</p>\n</div>\n</blockquote>\n<p></p>\n<h3>Shifting from Tech Support to a Web Developer</h3>\n<p>Good thing, there is newly opened web development company here in Antipolo so I left my job from the Metro to grab this opportunity closer to home. Luckily my web development projects from college served as my portfolio to land into that job. At this point of time, we are not mainly using WordPress and only use it as the part of the SEO process. A year has passed and I tried applying to companies that offers remote positions, luckily I was accepted by an Australian web development company. Before I switched my career in a remote working environment, I got married.</p>\n<blockquote class=\"instagram-media\"><div>\n<div>\n<div></div>\n</div>\n<p> <a href=\"https://www.instagram.com/p/BLc8Iy_AT4D/\" target=\"_blank\"><img src=\"https://s.w.org/images/core/emoji/2/72x72/1f642.png\" alt=\"','no'),(473,'_transient_timeout_feed_mod_d117b5738fbd35bd8c0391cda1f2b5d9','1478013007','no'),(474,'_transient_feed_mod_d117b5738fbd35bd8c0391cda1f2b5d9','1477969807','no'),(475,'_transient_timeout_feed_b9388c83948825c1edaef0d856b7b109','1478013008','no'),(476,'_transient_feed_b9388c83948825c1edaef0d856b7b109','a:4:{s:5:\"child\";a:1:{s:0:\"\";a:1:{s:3:\"rss\";a:1:{i:0;a:6:{s:4:\"data\";s:3:\"\n	\n\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:7:\"version\";s:3:\"2.0\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:0:\"\";a:1:{s:7:\"channel\";a:1:{i:0;a:6:{s:4:\"data\";s:117:\"\n		\n		\n		\n		\n		\n		\n				\n\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n\n	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"WordPress Plugins » View: Popular\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:45:\"https://wordpress.org/plugins/browse/popular/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"